        "Error":"Error",
        "Error12SelfTestFail":"Error 12: Self-Test failed",
        "Error12SelfTestFailSub1":"During a system check a part of your unit's configuration has reported less than optimal performance. The system could be displaying a non-critical error message. If you have a boost in cellular service at your service antenna you can ignore the E12 message. If you do not have a boosted signal, check to confirm that both your service antenna and donor antenna are properly connected and functional.  If the antennas checkout, the boost number on the unit is high, and you still don't have a boosted signal try restarting the unit.  If the problem persists after a restart please contact your point-of-sale for farther assistance.",
        "Error12SelfTestFailSub3":"If you recently updated the software on your device, try again. If the error persists please contact your point-of-sale for farther assistance.",
        "Error1NotReceivingSignal":"Error 1: Not receiving a signal from the cellular network",
