        "Error4NUOverheating":"Error 4: Network Unit is overheating",
        "Error4NUOverheatingLine2Sub1":"Your Network Unit (also known as a Window Unit) is overheating. Please ensure that your Network Unit vents are clear of any blockage and that the location of the unit allows a free flow of air. If you have your Network Unit in an exceptionally warm area you may need to relocate the device to ensure that the system does not continue to overheat. Once your Network Unit has cooled down it will operate as normal.",
        "Error4NUOverheatingLine2Sub2":"Note: Your Network Unit will continue to search for the Coverage Unit. The normal operating temperature of the Cel-Fi unit is 0-40 degrees Celsius.",
        "Error4NUOverheatingSub1":"Your Network Unit is overheating. Please ensure that your Network Unit vents are clear of any blockage and that the location of the unit allows free flow of air. If you have your Network Unit in an exceptionally warm area you may need to relocate the device to ensure that the system does not continue to overheat. Once your Network Unit has cooled down it will operate as normal.",
