        "Error5RegRequired":"Error 5: Registration required",
        "Error5RegRequiredSub1":"Before use, you must register this device and have your provider's consent. You must operate this device with approved cables as specified by the manufacturer. Systems can be registered HERE.",
        "Error6HwError":"Error 6: Hardware error",
        "Error6HwErrorSub1":"Your GO Unit is experiencing a hardware failure. Try this… reset your GO device. To do this simply unplug your GO from the power source for a few seconds and plug it back in. If the problem persists after a restart, please contact your point-of-sale for farther assistance.",
        "Error6HwErrorSub2":"Try this… check the connection between your Donor Antenna and GO. Confirm that your antenna is properly connected and working. You may need to try another Donor Antenna. Using your cellular device, try to find a location with at least one consistent bar of 3G/4G/LTE. More bars are always better! Once you have found a usable signal, place your Donor Antenna in this location.",
        "Error6HwErrorSub3":"Your Donor Antenna is too close to a cellular tower. This may result in a reduced output power (smaller coverage bubble) to limit network interference.",
