        "FindCellularSignal":"Find the best cellular signal",
        "FindLocationContent":"Position the Smart Signal Booster on the wall as far from the Coverage Unit as possible (this will improve isolation). Approximately 2 meters above the floor in a vertical position. Closest to the building exterior is the ideal location. Make sure the Smart Signal Booster is not blocked or covered by large objects such as furniture.",
        "FindLocationForTheSmartSignalBooster":"Find a location for the Smart Signal Booster",
        "FindLocationWithBestCoverage":"Find the location with the best coverage:",
        "FirstName":"First name",
