        "LocatePowerOutletContent":"Plug the Coverage Unit into the power outlet in the room/area identified in Step 1. Wait for the system to start up. You see a solid blue light when the system is ready. The power outlet should not be behind any large objects, such as furniture, as this will interfere with the signal. It is acceptable for the Coverage Unit to be rotated in any direction.",
