        "MountTheSys":"Mount the System",
        "MountTheSystemContent":"The mounting bracket for the Smart Signal Booster can be installed either on a flat surface or in a corner. Use either the supplied double-sided tape or screw kit (you do not need both). If you are using tape, make sure it is placed to extend below the mounting bracket for easy removal. Attach the Smart Signal Booster to the mounting bracket. Remember to mount the Smart Signal Booster vertically.",
