        "NUHardWareError":"Error 6: Network Unit Hardware Error",
        "NUHardWareErrorSub1":"Your Network Unit may be experiencing a hardware error that might be remedied by a reset. Try this... simply unplug your Network Unit for a few seconds and plug it back in. If the problem persists after a restart please contact your point-of-sale for further assistance.",
        "NumDisplayCycling":"Numeric Display is Cycling/Rotating",
        "NURedErrorMessage":"Network Unit Red Error Message",
        "NUTroubleShooting":"Network Unit Troubleshooting",
        "NUTroubleShootingLine1":"When your system does not power up, one of the following things could be happening. You could have a power adaptor failure, a hardware failure, or the system could need a simple restart. Try this... both the Network Unit and Coverage Unit have identical power supplies. Switch the power supplies to see if one of the following issues could be occurring:",
        "NUTroubleShootingLine10":"Ensure that your Coverage Unit (CU) is plugged in and has power. If your Coverage Unit does not have power, review the PRO Coverage Unit (CU) troubleshooting section.",
        "NUTroubleShootingLine11":"Make sure that your Units are not too far apart. Try placing the systems 10-15 feet apart to ensure they can connect. The more interference (i.e. walls, doors, refrigerators, filing cabinets) between the two units the closer they will need to be. Once you have established a connection you can optimize the displayed number by moving either unit.",
        "NUTroubleShootingLine12":"Intermittent too far issues. Even if the system is showing maximum bars you can have the systems slightly too far apart. This may cause you to experience intermittent interference which can cause the connection to break. Frequent or intermittent issues can be related to heavy Wi-Fi saturation in your home/office or obstacles that move between the two unit's line of sight. Make sure that each unit is as far as possible from any access points or other Wi-Fi enabled devices. An example of a wireless device could be but is not limited to, a wireless home phone, laptop computer, or wireless router.",
        "NUTroubleShootingLine2":"If you switch the power supplies and the problem moves from one unit to the other unit then you are experiencing a power supply issue. Please reach out to your point-of-sale for a replacement power supply.",
        "NUTroubleShootingLine3":"If, after switching power supplies, you still have no power on your Network Unit try another outlet or different appliance in the same outlet. If you continue to have problems with the Network Unit please reach out to your point-of-sale for a system replacement.",
        "NUTroubleShootingLine4":"If, after switching power supplies, both systems are functioning properly then your Cel-Fi PRO simply needed a restart. This is not something that should continue, but if it occurs frequently please reach out to your point-of-sale for support.",
        "NUTroubleShootingLine5":"If you have no bars, your Network Unit is still trying to find the incoming cellular network signal. Your Network Unit may display the \"Searching for the Network...\" message. This can sometimes take more than a few minutes.<br><br>Taking longer than 60 minutes? Try this...",
        "NUTroubleShootingLine6":"Walk around your home/office with your cellular device. Try to find a signal inside your home/office with at least one consistent bar of 3G/4G/LTE. More bars are always better! Once you have found a signal place your Network Unit in that location.",
        "NUTroubleShootingLine7":"If you have bars of service on your phone in the location of your Network Unit, but after 60 minutes you are unable to receive bars of service on your Network Unit, try a simple restart. To restart your Network Unit simply unplug it for a moment and then plug back in. If the restart does not solve the issue please reach out to your point-of-sale for support..",
        "NUTroubleShootingLine7a":"Network Unit (NU) continues to search for the Coverage Unit (CU)",
        "NUTroubleShootingLine8":"Your Cel-Fi PRO has found the network and is displaying bars over the (NU) Network Unit icon, but continues to try and find a connection to the Coverage Unit (CU).",
        "NUTroubleShootingLine9":"If this screen is displayed for more than 30 minutes, after your Network Unit shows bars, you could have one of the following issues with your Cel-Fi PRO system.",
        "Of":"of",
