        "Offline":"Offline",
        "OnceInstalledRequireMaintenanceOrAdjustments":"Once installed, will the Cel-Fi require maintenance or adjustments if changes occur to the native cellular network?",
        "OnceInstalledRequireMaintenanceOrAdjustmentsAnswer":"No. Cel-fi does not require any maintenance. The Cel-Fi systems will self-adjust and reconfigure automatically to changing cellular networks situations.",
