        "OptimizeCoverage":"Optimize the Coverage",
        "OptimizeCoverageUnitPlacement":"Optimize The Coverage Unit Placement:",
        "OptimizeCoverageUnitPlacementText":"The number on the front of the Coverage Unit display indicates the quality of the placement. For the best service experience, move the Coverage Unit around in your desired location until an 8 or 9 is displayed.",
        "OptimizeCUPlacement":"Optimize the Coverage Unit Placement:",
        "OptimizeNetworkUnitPlacement":"Optimize the Network Unit Placement:",
        "OptimizeNetworkUnitPlacementText":"The bars on the front of the device indicate the strength of the mobile network signal in the area. Moving the Network Unit to a different location, even just a few meters in your home, may increase the signal and can improve the quality of your service. It is recommended to try a few locations to determine the ideal spot.",
