        "PlaceNetworkUnit":"Place the Network Unit",
        "PlaceNUWithCoverage":"Place the Network Unit near a window with coverage",
        "PlaceNUWithCoverageText":"Find a convenient location near a window with coverage, (the system uses the outside cellular signal) and for best performance, one wall away from the Coverage Unit. Make sure a 3G, 4G, or LTE icon is displayed on your handset.",
        "PlaceSignalBooster":"Place Smart Signal Booster",
        "PlaceSignalBoosterContent":"Position the Smart Signal Booster on the wall as far from the Coverage Unit as possible (this will improve isolation). Approximately 2 meters above the floor in a vertical position. Typically, closest to the building exterior is an ideal location. Make sure the Smart Signal Booster is not blocked or covered by large objects such as furniture.",
