        "PlugInCelFiGo":"Plug in Cel-Fi GO & Select Mode",
        "PluginNetworkUnit":"Plug in the Network Unit:",
        "PluginNetworkUnitCUText":"Plug the units into an easily accessible outlet at the locations identified (Note: the power supplies in your kit are identical). Make sure that at least one bar is displayed on the signal strength indicator on the front of the Network Unit. If you do not see at least one bar, try a different location.",
        "PluginNUandCU":"Plug in the Network and Coverage Units",
        "PoorCoverage":"Poor Coverage",
