        "RegistrationLine2":"The information collected during registration includes: user contact information, the address where the booster is used, booster make, model and serial number. This information will enable the carrier to contact users or locate the booster in the event of network issues. Any information collected through this program will be used as described above and is subject the Cel-Fi’s Privacy Policy",
        "RegistrationPrivacyText":"Here at Nextivity we take your privacy seriously and will only use your personal information to administer your account  and to provide the products, services and support you have requested from us. <br><br>Please note that we never provide your personal information to any third parties.",
