        "SharingPersonalInfoSub":"Telecommunications operators such as AT&T or T-Mobile (an \"Operator\") may be required under applicable law (for example, 47 CFR 20.21(h) in the United States) to register users of a Nextivity Product. If, through the Services, you choose to (i) register your Nextivity Product with an Operator or (ii) create an account on Cel-Fi’s WavePortal, then we may disclose information you provide to us in connection with such registration or account creation or your geolocation information based on the use of your Nextivity Product to such Operator or its affiliates or the distributors or resellers through which you purchased a Nextivity Product (collectively, \"Distributors\"). For example, we may disclose your name, physical address, email address, phone number, fax number, geolocation of your Nextivity Product, and/or Nextivity Product device ID to such Operators.  Also, if you purchased your Nextivity Product through an authorized Nextivity distributor (\"Distributor\"), then we may also share the foregoing information with such Distributors. We have no control over the policies and practices of Operators or Distributors as to privacy, their use or disclosure of your personal information, or anything else. So if you choose to register your Nextivity Product with an Operator or purchase your Nextivity Product through a Distributor, please review all of that Operator’s and/or Distributor’s relevant policies on privacy. For your information, and without limiting what an Operator or Distributor may do with your personal information, please recognize that Operators and Distributors may be required to disclose your personal information in accordance with applicable law. By submitting personal information to us in connection with the registration of a Nextivity Product or by creating an account on WavePortal, you agree to hold Nextivity harmless against any disclosure, use, or security of such personal information by an Operator, Distributor or their agents.",
        "SharingPersonalInfoSub2":"We may anonymize your personal information so that you are not individually identified, and provide that information to our partners or other third parties. We may also use your personal information on an aggregated basis to improve our products, services, and offerings thereof. However, we never disclose aggregate information to a partner or third party in a manner that would identify you personally, as an individual",
        "SharingPersonalInfoSub3":"We are based in the United States, which is where we process and store the information we collect from you. By providing your personal information to us in connection with the Services, you consent to the transfer to and the processing of such information in the United States. We will use the information you provide to monitor the operating conditions of your Nextivity product. If at any time you wish us to stop monitoring your Nextivity product, please contact us at support@cel-fi.com.",
