        "StepFour":"STEP 4",
        "StepFourSubText":"Connect the white Power Cable (supplied) to the bottom of the Signal Booster and then to the Power Supply. Plug the Power Supply into the outlet identified in Step 2. It will take the system a couple of minutes to power up and optimize itself. When you see the blue light, you are all done.",
        "StepOne":"STEP 1",
        "StepThree":"STEP 3",
        "StepThreeSubText":"The mounting bracket for the Signal Booster can be installed either on a flat surface or in a corner. But the system will typically work best when placed in a corner. Use either the supplied double sided tape or screw kit (you don’t need to use both). Attach the Signal Booster to the mounting bracket. Make sure the logo on the front of the device is upright.",
        "StepTwo":"STEP 2",
        "StepTwoSubText":"Remember, the Signal Booster needs to be placed where the cellular signal is strongest. Higher on the wall is better and it needs to be mounted vertically to operate correctly. There must be a power outlet within 5 meters of the Signal Booster, and it works best when the Power Supply is separated by as much space as possible.",
