        "TermsPolicy":"Terms/Policy",
        "TermsPolicyContent1":"At Nextivity, Inc., we adhere to industry-standard procedures to ensure your privacy. This privacy policy applies to data collection and usage on all Nextivity websites and related services (including, without limitation, any Nextivity mobile application) (collectively, the \"Services\"). Nextivity's websites are general audience websites.</br></br>Personal information of all users of the Services is collected, used and disclosed by us as described in this policy statement.  This policy statement does not cover the treatment, collection, use or disclosure of personal information by companies that we don't own or control, or people that we don't manage.",
        "TermsPolicyLine1":"At Nextivity, Inc., we adhere to industry-standard procedures to ensure your privacy. This privacy policy applies to data collection and usage on all Nextivity websites and related services (including, without limitation, any Nextivity mobile application) (collectively, the \"Services\"). Nextivity's websites are general audience websites.",
        "TermsPolicyLine10":"We employ other companies and people to perform tasks on our behalf and need to share your information with them to provide products or services to you. Unless we tell you differently, our agents do not have any right to use the personal information we share with them beyond what is necessary to assist us.",
        "TermsPolicyLine11":"We may choose to buy or sell assets, and may share and/or transfer customer information in connection with the evaluation of and entry into such transactions. Also, if we (or our assets) are acquired, or if we go out of business, enter bankruptcy, or go through some other change of control, personal information could be one of the assets transferred to or acquired by a third party.",
        "TermsPolicyLine12":"Protection of Company and Others",
        "TermsPolicyLine13":"We reserve the right to access, read, preserve, and disclose any information that we reasonably believe is necessary to comply with law or court order; enforce our agreements; or protect the rights, property, or safety of Company, our employees, our users, or others",
        "TermsPolicyLine14":"Managing personal information",
        "TermsPolicyLine15":"You may contact Nextivity via e-mail at info@nextivityinc.com and we will attempt to assist you to remove, review, or revise any or all personal information that you have previously provided to us.",
        "TermsPolicyLine16":"Additional information regarding privacy policy",
        "TermsPolicyLine17":"If at any time you believe that Nextivity has not adhered to this privacy policy, or if you have questions regarding the policy or our methods of collecting and/or use of your personal information, please contact us. You may contact Nextivity via e-mail at info@nextivityinc.com, using the word \"privacy\" in the subject line.",
        "TermsPolicyLine18":"This policy does not apply to Operators or other online or offline partner or affiliated sites, products or services that may be electronically linked to our company website(s). Nextivity is not responsible for enforcing the privacy policies of such websites. Further, Nextivity is not responsible for the content included on such websites, including but not limited to special offers, text, copy, photos, images and advertising claims or names.",
        "TermsPolicyLine19":"Under California Civil Code Sections 1798.83-1798.84, California residents are entitled to ask us for a notice identifying the categories of personal information which we share with our affiliates and/or third parties for marketing purposes, and providing contact information for such affiliates and/or third parties. If you are a California resident and would like a copy of this notice, please submit a written request to: info@nextivityinc.com.",
        "TermsPolicyLine2":"Personal information of all users of the Services is collected, used and disclosed by us as described in this policy statement.  This policy statement does not cover the treatment, collection, use or disclosure of personal information by companies that we don't own or control, or people that we don't manage.",
        "TermsPolicyLine20":"Your browser may offer you a \"Do Not Track\" option, which allows you to signal to operators of websites and web applications and services (including behavioral advertising services) that you do not wish such operators to track certain of your online activities over time and across different websites. Our Services do not support Do Not Track requests at this time, which means that we collect information about your online activity both while you are using the Services and after you leave our Services.",
        "TermsPolicyLine3":"We do not collect personal information about you unless you voluntarily provide it to us. For example, some of the purposes for which we collect such information are: to register your Nextivity product; provide feedback in our online surveys; request product information; and/or request contact from a Nextivity representative. Nextivity collects and uses your personal information in connection with the Services, to deliver the products and services you have requested, and as explained in more detail below. In certain cases, we may share some of your personal information with third parties, but only as described below.",
        "TermsPolicyLine4":"Please note that Nextivity may contact you about matters pertaining to your ownership of Nextivity products, or your interactive use of the company's website(s); for example, access to download new product software releases. If you do not want to receive communications from us, please indicate your preference by sending an email to:  support@cel-fi.com.",
        "TermsPolicyLine5":"The personal information that may be gathered includes your name, telephone number(s), fax number, street address, mailing address and e-mail address. You may also be asked to provide other information about yourself such as your job category, industry type, company name and job title, and/or the number of people in your company.",
        "TermsPolicyLine6":"Sharing personal information",
        "TermsPolicyLine7":"Telecommunications operators such as AT&T or T-Mobile (an \"Operator\") may be required under applicable law (for example, 47 CFR 20.21(h) in the United States) to register users of a Nextivity Product. If, through the Services, you choose to register your Nextivity Product with an Operator, then we may disclose your personal information to such Operator or its affiliates in connection with such registration. We have no control over the policies and practices of Operators as to privacy, their use or disclosure of your personal information, or anything else. So if you choose to register your Nextivity Product with an Operator, please review all of that Operator's relevant policies on privacy. For your information, and without limiting what an Operator may do with your personal information, please recognize that Operators may be required to disclose your personal information in accordance with applicable law. By submitting personal information to us in connection with the registration of a Nextivity Product, you agree to hold Nextivity harmless against any disclosure, use, or security of such personal information by an Operator or its agents.",
        "TermsPolicyLine8":"We may anonymize your personal information so that you are not individually identified, and provide that information to our partners or other third parties. We may also use your personal information on an aggregated basis to improve our products, services, and offerings thereof. However, we never disclose aggregate information to a partner or third party in a manner that would identify you personally, as an individual",
        "TermsPolicyLine9":"Personal information collected on any or all Nextivity websites may be stored and processed in the United States or any other country in which Nextivity or its affiliates, subsidiaries or agents maintain facilities. By using this site, or our Services, you consent to any such transfer of information outside of your country.",
