        "ThisIsAConsumerDevice1":" meet all requirements set out in CPC-2-1-05.",
        "ThisIsAConsumerDevice2":"You MUST operate this device with approved antenna and cables as specified by the manufacturer. The Antenna MUST be installed at least 20 cm (8 inches) from any person. You MUST cease operating this device immediately if requested by FCC, Innovation, Science and Economic Development Canada or a licensed wireless service provider.",
        "ThisIsAConsumerDevice3":"Location information may not be provided or may be inaccurate for calls serviced by using this device.",
