        "TroubleShootingPrimeBlinkingBlue":"My Status Indicator is blinking blue",
        "TroubleShootingPrimeFlashingRed":"My Status Indicator is Flashing Red",
        "TroubleShootingPrimeSolidBlue":"My Status Indicator is Solid blue but my phone still has poor signal",
        "TroubleShootingPrimeSolidRed":"My Status Indicator is Solid Red",
        "TroubleShootingPrimeSolidRedDescription":"There are several reason why your status light would be solid red. The best way to determine the specific reason for your flashing light is to use the Wave Mobile or Desktop application while connected to your device. For more information see the list of PRIME errors below:",
        "TroubleShootingPrimeText1":"Make sure that your power source is a functional power outlet. Test something else that you know works in the same power source, or try moving the PRIME Power Supply to another power source that you have confirmed has working power. Still Not Working? It is possible that you have a bad power supply, or a malfunction of your PRIME Signal Booster hardware. Please reach out to your point-of-sale for further instructions.",
        "TroubleShootingPrimeText2":"If you switched power supplies and both systems are functioning properly then your Cel-Fi PRIME simply needed a restart. This is not something that should continue, but if it occurs frequently please reach out to your point-of-sale for support. If you have power on your Network Unit with a white or otherwise abnormal colored display, please contact your point-of-sale for specific warranty support.",
        "TroubleShootingPrimeText3":"A blinking blue status indicator means that your Cel-Fi PRIME is still in the startup process. Depending on the complexity of your cellular network, this process can take some time. If the Signal Booster’s Status Indicator continues to blink for more than 30 minutes please attempt a restart.",
        "TroubleShootingPrimeText4":"If your Cel-Fi PRIME Signal Booster has a solid Status Indicator with a blue light, the system is fully functional.",
        "TroubleShootingPrimeText5":"If your system has a solid blue status light but your phone is not picking up a stronger cellular signal you might need to check the power cable connections and your phones compatibility with the selected network.",
        "TroubleShootingPrimeText6":"Some cellular devices use a combination of many different factors to calculate the number of “bars” displayed. To determine if your signal strength is stronger, you can look for your signal strength while PRIME is plugged in and not plugged in. For more information please reach out to your point-of-sale.",
        "TroubleShootingPrimeText7":"There are several reasons why your status indicator would be flashing red. The best way to determine the specific reason for your flashing light is to use the Wave Mobile or Desktop application while connected to your device. For more information see the list of PRIME errors below:",
