        "Welcome":"Welcome",
        "WhatCelFiDifferentFromOtherSignal":"What makes Cel-Fi so different from other signal boosters?",
        "WhatCelFiDifferentFromOtherSignalAnswer":"Cel-Fi is a smart signal booster. That means it relies on intelligent, self-organizing algorithms to ensure you benefit from the largest area of coverage without compromising or interfering with your mobile operator's networks or impeding other subscribers' signals. Cel-Fi does not require any new equipment, any configuring, or any changes to existing network infrastructure or mobile devices. It is also a plug and play device, which means that there is no need for professional installation, no drilling, and no cables. In addition, Cel-Fi has been recognized for its superior design and effectiveness and is the only consumer booster authorized for use by the communications commissions in Australia and the United Kingdom, and the only Smart Booster designed to meet the new FCC Safe Harbor 2 specifications that allow very high gain (very high signal gain is necessary to make low level signals useful in a large coverage area).",
        "WhatCoverageFromCelFiSystem":"What coverage can I expect from a Cel-Fi system?",
        "WhatCoverageFromCelFiSystemAnswer1":"The radius (half the width) of the coverage bubble is approximately the distance between the Coverage Unit and Network (window) Unit. Here are some examples:",
        "WhatCoverageFromCelFiSystemAnswer2":"Radius = 20 meters (66 ft.) for wood framed walls",
        "WhatCoverageFromCelFiSystemAnswer3":"Radius is less for concrete interior walls",
        "WhatCoverageFromCelFiSystemAnswer4":"Radius can easily exceed 65 meters (200 ft.) for open commercial spaces.",
        "WhatDataCollected":"What data is collected?",
        "WhatDataCollectedAnswer":"The information collected during registration includes user contact information, the address where the booster is used, booster make, model and serial number. This information will enable the carrier to contact users or locate the booster in the event of network issues. Any information collected through this program will be used as described above and is subject the Cel-Fi's Privacy Policy",
        "WhatDataCollectedAnswerSub":"For more information and helpful videos about installation and registration of your Cel-Fi Booster, please visit",
        "WhatFrequenciesLinkTheNW":"What frequencies link the Network (Window) Unit and Coverage Unit?",
        "WhatFrequenciesLinkTheNWAnswer":"Cel-Fi automatically selects clear, unused channels from the UNII bands (5.15-5.35 GHz, 5.47-5.725 GHz and 5725-5825 GHz) for communication between the Network (Window) Unit and the Coverage Unit. While in some cases these are the same frequencies as Wi-Fi, the Cel-Fi system uses a proprietary protocol for communication and is designed to work in harmony with existing wireless devices such as Wi-Fi routers, cordless telephones, or baby monitors.",
        "WhatIsCelFi":"What is Cel-Fi?",
        "WhatIsCelFiAnswer":"Cel-Fi is Nextivity's brand of self-configuring, environmentally aware, indoor coverage solutions. Each Cel-Fi system consists of two units. The Network Unit is placed in the area where the strongest native signal can be received from the carrier network (signal levels as low as -120 dBm are acceptable). The Network Unit comprises a transmitter and receiver which communicates with the cell tower. The Coverage Unit is placed in the center of the home, communicates wirelessly with the Network Unit and “lights up” the interior of the house with significantly enhanced signal levels, thus enabling better quality calls and greater data throughput.",
        "WhatIsIntelliBoost":"What is IntelliBoost?",
        "WhatIsIntelliBoostAnswer":"The Nextivity IntelliBoost Baseband Processor is the first core processor designed specifically to optimize the indoor transmission and reception of 3G and 4G/LTE wireless signals. With advanced filtering, equalization and echo cancellation techniques, Nextivity has developed an embedded architecture which delivers unprecedented in-building data rates and pervasive 3G and 4G/LTE connectivity. The IntelliBoost processor ensures that Cel-Fi products never negatively impact the macro network while providing maximum coverage.",
        "WhatTechnologiesCelFiSupport":"What technologies does Cel-Fi support?",
        "WhatTechnologiesCelFiSupportAnswer1":"Cel-Fi system will support 3G(UMTS/WCDMA), 4G (HSPA/HSPA+) and LTE.",
        "WhatTechnologiesCelFiSupportAnswer2":"Each Cel-Fi system is different. Check your box for a Quick Start Guide, or visit the support section of our website for more information about your specific product.",
        "WhyDoesntWorkWithDifferentOperators":"Why doesn't Cel-Fi work with different operators?",
        "WhyDoesntWorkWithDifferentOperatorsAnswer":"Not all cellular operators use the same technologies, and we do not boost every technology available around the world. The Cel-Fi systems will support 3G(UMTS/WCDMA), 4G(HSPA & HSPA+), and LTE technology of operators that have approved the use of Cel-Fi on their network. You can reach out to your operator for more information on what specific technology they use.",
        "WhyDoIHaveToRegister":"Why do I have to register my Cel-Fi?",
        "WhyDoIHaveToRegisterAnswer":"Why is this being done?  Because cellular systems are protected assets of the Operators that own them.  Many boosters in the market cause problems for those networks (which means all of us using the networks too).  New FCC/Operator approved boosters are better and don't cause problems, and Cel-Fi is the only booster in a special class of boosters that allows 100 dB of signal gain (30 dB or 1000x the gain of all other boosters).",
        "WhyRegister":"Why Register",
        "WhyToRegister":"Why do I need to register?",
        "WillCelFiSupportVoiceAndData":"Will the Cel-Fi support voice and data or data only?",
        "WillCelFiSupportVoiceAndDataAnswer":"Yes, Cel-Fi smart signal boosters can support both voice and data simultaneously. Note: Cel-Fi RS1 and RS2 models do not support LTE.",
        "WirelessLinkDown":"Wireless Link Down",
        "WirelessLinkDownSub1":"Wireless link between the Network Unit and Coverage Unit is down.  Please wait for the link to connect and try again.",
