        "YouAreCurrentlyOfflineText":"Your booster and app will continue to work normally, but no diagnostic data will be sent to the cloud. Restart the app to check for online mode.  Note: if you have multiple operators setup, you may be able to switch the Operator.",
        "YouAreUpToDate":"You're up-to-date",
