        "BoostOptimizer":"Optimizador de Amplificación",
        "BoostOptimizerText":"La forma en la que ubique su Amplificador y su Fuente de Alimentación puede tener una gran influencia en la calidad de señal obtenida. Nuestras instrucciones paso a paso le guiarán en el proceso de instalación.",
        "BusinessTransfers":"Transferencias comerciales",
        "BusinessTransfersSub1":"Podremos decidir comprar o vender activos, y podremos compartir y/o transferir los datos de nuestros clientes en relación con la evaluación y realización de dichas transacciones. Además, si nuestra compañía (o nuestros activos) fuera adquirida por otra compañía, o si cerráramos, nos declarásemos en quiebra o hubiera algún otro cambio de control en nuestra compañía, los datos personales podrían ser uno de los activos transferidos o adquiridos por un tercero.",
