        "CellularSigTooWeakBoost":"La señal celular es demasiado débil para ser amplificada. ",
        "CellularSigTooWeakBoostSub1":"Intente lo siguiente…Camine por la casa/oficina con su dispositivo celular. Intente encontrar un lugar en el interior donde tenga, al menos, una barra permanente de 3G/4G/LTE. Cuantas más barras, mejor. Cuando haya encontrado un lugar con buena señal, coloque su Unidad de Red (también llamada Unidad Ventana) en ese lugar. Nota: Si tiene instalada una Antena Donante externa, verifique la conexión.",
        "CellularSigTooWeakBoostSub2":"Intente lo siguiente…traslade su Unidad de Red a otro lugar. Tal vez deba trasladar su sistema al otro lado de su casa/oficina. ",
