        "ConfirmationToUnpairDevice":"¿Está seguro que quiere desemparejar esta antena y el dispositivo? Si lo hace, la App olvidará al dispositivo y podrá realizar un nuevo emparejamiento.",
        "ConfirmationForRestart":"¿Desea reiniciar la aplicación y buscar dispositivos disponibles?",
        "ConfirmOpChange":"Este proceso llevará unos minutos y su dispositivo se reiniciará automáticamente durante el mismo. ¿Está seguro que quiere continuar?",
        "ConfirmOptimizeYourPlacement":"Confirme y Optimice su ubicación",
        "ConfirmOptimizeYourPlacementContent":"Una vez que el sistema está amplificando, compruebe el Nivel de Amplificación (consulte la vista del tablero de instrumentos). Si está satisfecho con el número y la mejora de la señal, continúe con el paso 6. Para optimizar la amplificación repita los pasos 4 a 6.",
        "ConfirmPlacement":"Confirme la colocación",
        "ConfirmPlacementContent":"Una vez el sistema esté amplificando, compruebe el nivel de amplificación (Boost Number). Si no está satisfecho con este número y la mejora de señal, repita estos pasos. Localice una señal de entrada más potente para el Amplificador Inteligente de Señal o una ubicación más expuesta para la Unidad de Cobertura",
        "Connect":"Conectar",
        "ConnectAntennaCelFiGo":"Conecte las Antenas a la Unidad Cel-Fi GO",
        "ConnectBoosterToComputer":"Debe conectar su amplificador a su computadora para actualizarlo. Para más instrucciones, vaya a",
