        "ConnectionFailReferHelpPage":"No se ha detectado un amplificador. Si ya puso en marcha su dispositivo Cel-Fi, quizás se requiera que se acerque (dentro del rango del Bluetooth).",
        "ConnectUnits":"Conecte las unidades",
        "ConnectUnitsContent":"Conecte el Amplificador Inteligente de Señal a la Unidad de Cobertura (fuente de alimentación) con el cable suministrado. No enchufe la Unidad de Cobertura todavía a la toma de corriente.",
