        "DetermineAndPlaceCovrageUnit":"Determine where you need <br> coverage & place the Coverage Unit",
        "DetermineAndPlaceCovrageUnitText":"The Coverage Unit should be placed where coverage is most needed. The improved coverage bubble will be centered at the Coverage Unit when the system is operational. For best performance the Coverage Unit should be placed with physical separation from the Network Unit. This can be accomplished with distance and one or two walls.",
