        "DoesCelFiRequiresInternetOrGpsAnswer":"No. El sistema Cel-Fi solo necesita tener como mínimo 1 barra de señal celular antes de instalarse en al menos un punto de la casa para poder cubrir toda su casa u oficina.",
        "Done":"Listo",
        "DownloadErrMsg1":"Lo sentimos, el servidor está tardando demasiado en responder. Inténtelo de nuevo más tarde.",
        "DownloadErrMsg10":"Falló el reinicio del dispositivo Cel-Fi (5.1.9).",
