        "LocationLockSet":"Bloqueo de Ubicación fijado",
        "LocationName":"Nombre del lugar:",
        "LocationRegSub1":"Su sistema ha sido trasladado a otra dirección. Por favor, regrese el sistema a su dirección original o registre su nueva dirección en su proveedor de servicios inalámbricos. Puede registrar los sistemas AQUÍ.",
        "Locations":"Ubicaciones",
        "LocationService":"Servicio de localización",
        "LocationServiceOff":"El servicio de localización (GPS) puede estar apagado o con una señal débil. Verifique que el servicio de localización está habilitado y reinicie la App.",
        "LocationServices":"Servicios de localización",
        "LocationServicesIos":"Los organismos reguladores y / o los operadores de redes móviles requieren la  ubicacion de equipos Cel-Fi, en caso de problemas de red. Cualquier información recopilada a través de esta aplicación se mantiene de forma privada y está sujeta a la Política de privacidad de Cel-Fi.",
        "LocationServicesRequired":"Servicios de ubicación requeridos",
        "LocationServicesRequiredText":"Android 6.0 o superior requiere que los Servicios de localización estén habilitados para Bluetooth LE para encontrar dispositivos Cel-Fi. Encienda los servicios de ubicación desde la configuración de su sistema.",
        "LocationServiceDisabledIOS":"Servicio de localización deshabilitado",
        "LocationServiceDisabledIOSText":"Los servicios de ubicación están deshabilitados para este dispositivo. Habilite los Servicios de ubicación en Configuración seleccione  ( Privacidad> Servicios de ubicación) y vuelva a intentarlo. Pulse en Omitir para continuar sin habilitar los Servicios de ubicación.",
        "LowBarsOnCU":"Poca cantidad de barras en la Unidad de Cobertura",
