        "More":"Más",
        "MountCelFiGo":"Instale el Cel-Fi GO",
        "MountTheSys":"Instale el sistema",
        "MountTheSystemContent":"El soporte de montaje para el Amplificador Inteligente de Señal se puede instalar en una superficie plana o en una esquina. Utilice la cinta de doble cara o el kit de tornillos (no necesita ambos). Si está usando cinta, asegúrese de que esta sobresale ligeramente por debajo del soporte de montaje para facilitar su extracción. Fije el Amplificador Inteligente de Señal al soporte de montaje. Recuerde, asegúrese de que el Amplificador esté montado verticalmente.",
