        "NotreceivingsignalE1":"No se recive señal (E1)",
        "NotreceivingsignalE1Sub":"La señal celular es demasiado débil para ser amplificada. <br> Intente usar nuestra herramienta Búscador de Señal para identificar la mejor ubicación para la Unidad de Red (NU) ",
        "NoWiFiCell":"No hay WiFi ni servicio celular",
        "NoWiFiCellSub1":"No se puede conectar a la nube. No hay WiFi ni servicio celular disponible.",
        "NUHardWareError":"Error 6: Error de hardware de la Unidad de Red",
        "NUHardWareErrorSub1":"Su Unidad de Red puede estar teniendo un error de hardware que podría solucionarse reiniciándola. Intente lo siguiente…reinicie su Unidad de Red. Simplemente, desenchufe su Unidad de Red por unos segundos y vuelva a enchufarla. Si el problema continúa, contáctese con su punto de venta para recibir asistencia. ",
        "NumDisplayCycling":"El visor numérico queda dando vueltas/rotando",
        "NURedErrorMessage":"Mensaje de error de la Unidad de Red (NU)",
        "NUTroubleShooting":"Solución de problemas de la Unidad de Red",
        "NUTroubleShootingLine1":"Cuando su sistema no enciende, puede estar sucediendo alguna de las siguientes cosas. Puede estar fallando el adaptador de potencia, el hardware, o simplemente se necesita reiniciar el sistema.",
        "NUTroubleShootingLine10":"Asegúrese de que su Unidad de Cobertura (CU) esté enchufada y encendida. Si su Unidad de Cobertura no enciende, haga clic aquí para ir a la sección de solución de problemas de la Unidad de Cobertura (CU) del Cel-Fi PRO.",
        "NUTroubleShootingLine11":"Asegúrese de que sus Unidades no estén demasiado lejos. Intente colocar los sistemas a 10-15 pies de distancia para asegurarse de que puedan conectarse. Cuanta más interferencia haya (es decir, paredes, puertas, refrigeradores, armarios) entre las dos unidades, más cerca deberán estar. Una vez establecida la conexión, podrá optimizar el número que muestra el visor moviendo alguna de las unidades.",
        "NUTroubleShootingLine12":"Mensaje \"demasiado lejos\" intermitente.  Tal vez las unidades estén demasiado lejos. Esto puede provocar interferencias intermitentes que pueden interrumpir la cnexión. Los problemas frecuentes o intermitentes pueden estar relacionados con una gran saturación del Wi-Fi en su casa/oficina, o con obstáculos que se mueven entre las dos unidades. Asegúrese de que las unidades estén lo más lejos posible de los puntos de acceso u otros dispositivos con Wi-Fi. Los dispositivos inalámbricos pueden ser, entre otros, un teléfono inalámbrico, una laptop o un ruteador inalámbrico.",
        "NUTroubleShootingLine2":"Si intercambia las fuentes de alimentación y el problema pasa de una unidad a la otra, entonces el problema está en la fuente de alimentación. Por favor, vaya a su punto de venta para que se la cambien.",
        "NUTroubleShootingLine3":"Si, después de intercambiar las fuentes de alimentación, la Unidad de Red sigue sin encender, intente con otro enchufe, o con otra lámpara/electrodoméstico en el mismo enchufe. Si sigue teniendo problemas con la unidad, por favor, vaya a su punto de venta para que le cambien el sistema.",
        "NUTroubleShootingLine4":"Si, después de intercambiar las fuentes de alimentación, ambos sistemas funcionan correctamente, entonces su sistema Cel-Fi PRO solo necesitaba ser reiniciado. Esto no debería volver a ocurrir, pero si ocurre con frecuencia, por favor vaya a su punto de venta para que lo solucionen.",
        "NUTroubleShootingLine5":"Si no tiene barras, la Unidad de Red sigue intentando encontrar la señal de la red celular entrante. La Unidad de Red puede mostrar el mensaje \"Búsqueda de la red ... \". Esto a veces puede tomar más de unos minutos. ¿Toma más de 60 minutos? Pruebe esto...",
        "NUTroubleShootingLine6":"Camine por la casa/oficina con su dispositivo celular. Intente encontrar un lugar en el interior donde tenga, al menos, una barra permanente de 3G/4G/LTE. Cuantas más barras, mejor. Cuando haya encontrado un lugar con buena señal, coloque su Unidad de Red en ese lugar.",
        "NUTroubleShootingLine7":"Si tiene barras de servicio en su teléfono en el lugar donde está la Unidad de Red, y después de 60 minutos todavía no aparecen barras de servicio en su Unidad de Red, reinicie la unidad. Para reiniciar su Unidad de Red, simplemente desenchúfela por unos segundos y vuelva a enchufarla. Si esto no soluciona el problema, por favor vaya a su punto de venta para recibir ayuda.",
        "NUTroubleShootingLine7a":"La Unidad de Red (NU) continúa buscando a la Unidad de Cobertura (CU)",
        "NUTroubleShootingLine8":"Su Cel-Fi PRO ha encontrado la red y muestra barras en el ícono de la Unidad de Red, pero sigue intentando encontrar una conexión con la Unidad de Cobertura (CU).",
        "NUTroubleShootingLine9":"Si se muestra esta pantalla por más de 30 minutos después de que aparecieron las barras en la Unidad de Red, el sistema Cel-Fi PRO podría tener alguno de los siguientes problemas.",
