        "PlaceNUWithCoverage":"Place the Network Unit near a <br> window with coverage",
        "PlaceNUWithCoverageText":"Find a convenient location near a window with coverage, (the system uses the outside cellular signal) and for best performance, one wall away from the Coverage Unit. Make sure a 3G, 4G, or LTE icon is displayed on your handset.",
        "PlaceSignalBooster":"Fije el Amplificador Inteligente de Señal",
        "PlaceSignalBoosterContent":"Ubique el Amplificador Inteligente de Señal en la pared tan lejos como pueda de la Unidad de Cobertura (esto mejora el aislamiento entre ellas). Debe fijarse en vertical y a una altura de unos 2 metros sobre el suelo. Habitualmente la mejor ubicación está tan cercana como se pueda del exterior del edificio. Asegúrese que no hay objetos grandes, como muebles que bloquean o tapan al equipo.",
