        "PluginNetworkUnit":"Enchufe la Unidad de Red:",
        "PluginNetworkUnitCUText":"At the locations identified, plug the units into an easily accessible outlet. (Note: the power supplies in your kit are identical.) Make sure that at least one bar is displayed on the signal strength indicator on the front of the Network Unit. If you do not see at least one bar, try a different location.",
