        "Register":"Registrarse",
        "RegisterBooster":"Registrar amplificador",
        "Registering":"Registrando…",
        "Registration":"Registro",
        "RegistrationError":"Error de Registro",
        "RegistrationErrorSub1":"Error en el registro de usuario",
        "RegistrationErrorSub2":"Por favor contacte con su operador de red",
        "RegistrationLine1":"En algunos casos, los organismos de control y/o los operadores de redes móviles pueden exigir a los usuarios el registro del amplificador de señal.",
        "RegistrationLine2":"Los datos solicitados durante el registro son: información de contacto del usuario, dirección donde se utiliza el amplificador, marca, modelo y número de serie del amplificador. Con estos datos, el operador podrá contactarse con los usuarios o localizar el amplificador en caso de haber problemas con la red. Toda la información recabada a través de este programa se utilizará como se indica arriba y está sujeta a la Política de privacidad de Cel-Fi.",
        "RegistrationPrivacyText":"En Nextivity nos tomamos muy en serio su privacidad y solo usaremos su información personal para administrar su cuenta y proporcionarle los productos, servicios y asistencia que nos ha solicitado. <br> <br> Tenga en cuenta que nunca proporcionamos su información personal a terceros.",
        "RegistrationSignalBoosters":"Registro de los Amplificadores de Señal",
        "RegistrationSignalBoostersSub1":"En algunos casos, los organismos de control y/o los operadores de redes móviles pueden exigir a los usuarios el registro del amplificador de señal. Se le podrá exigir que registre el lugar donde se encuentra el amplificador si se muda a otra dirección.",
