        "SharingPersonalInfo":"Divulgación de datos personales",
        "SharingPersonalInfoSub":"Los operadores de telecomunicaciones como AT & T o T-Mobile (un \"Operador\") pueden ser requeridos bajo la ley aplicable (por ejemplo, 47 CFR 20.21 (h) en los Estados Unidos) para registrar usuarios de un Producto Nextivity. Si, a través de los Servicios, decide (i) registrar su Producto de Nextivity con un Operador o (ii) crear una cuenta en WavePortal de Cel-Fi, podremos compartir información que nos proporcione en relación con dicho registro o creación de cuenta o su información de geolocalización basada en el uso de su Producto Nextivity a dicho Operador o sus afiliados o los distribuidores o revendedores a través de los cuales adquirió un Producto Nextivity (colectivamente, \"Distribuidores\"). Por ejemplo, podemos revelar su nombre, dirección física, dirección de correo electrónico, número de teléfono, número de fax, geolocalización de su producto de Nextivity y / o identificación de dispositivo de producto de Nextivity a dichos operadores. Asimismo, si adquirió su Producto Nextivity a través de un distribuidor autorizado de Nextivity (\"Distribuidor\"), también podemos compartir la información anterior con dicho Distribuidor. No tenemos control sobre las políticas y prácticas de los Operadores o Distribuidores en cuanto a privacidad, uso o divulgación de su información personal, o cualquier otra cosa. Por lo tanto, si elige registrar su producto Nextivity con un operador o comprar su producto Nextivity a través de un distribuidor, revise todas las políticas relevantes de privacidad de dicho operador y / o distribuidor. Para su información y sin limitar lo que un Operador o Distribuidor puede hacer con su información personal, por favor reconozca que los Operadores y Distribuidores pueden estar obligados a revelar su información personal de acuerdo con la ley aplicable. Al enviarnos información personal en relación con el registro de un producto de Nextivity o mediante la creación de una cuenta en WavePortal, usted acepta mantener Nextivity a salvo de cualquier revelación, uso o seguridad de tal información personal por un Operador, Distribuidor o sus agentes.",
        "SharingPersonalInfoSub2":"Podremos enviar sus datos personales a nuestros socios o a terceros en forma anónima, de manera que no puedan identificarlo. También podremos usar sus datos personales como datos globales para mejorar nuestros productos, servicios y ofertas. No obstante, jamás divulgaremos datos globales a un socio o a un tercero de alguna forma que pueda identificarlo individualmente.",
        "SharingPersonalInfoSub3":"Estamos ubicados en los Estados Unidos, donde procesamos y almacenamos la información que recopilamos de usted. Al proporcionar su información personal en relación con los Servicios, usted acepta la transferencia y el procesamiento de dicha información en los Estados Unidos. Utilizaremos la información que proporcione para supervisar las condiciones de funcionamiento de su producto Nextivity. Si en cualquier momento desea que dejemos de supervisar su producto Nextivity, póngase en contacto con nosotros en support@cel-fi.com.",
