        "SkalErrorText0":"Un sensor de rotación no funciona, por lo que la antena puede tener dificultades para adaptarse a cambios rápidos de dirección. ",
        "SkalErrorText1":"La antena tiene un fallo en su memoria. Debido a este error la información de emparejamiento no puede ser salvada ni se puede actualizar el software.",
        "SkalErrorText2":"Hay un error en el mecanismo de orientación de la antena. Esto puede ser debido a que no funciona correctamente el sensor de posición o que la antena interna no puede moverse libremente.",
        "SkalErrorText3":"El sensor de posición indica que la antena está apuntando a una dirección inesperada. Posiblemente esto es debido a algún golpe o vibración, por lo que la condición es temporal y normalmente se corrregirá sola.",
        "SkalErrorText4":"El voltaje de alimentación en el conector de antena es demasiado bajo para una operación correcta (menos de 3.3 Voltios). La resistencia del cable de antena puede ser demasiado alta o la alimentación desde el Cel-Fi GO puede ser insuficiente.",
