        "StepFour":"PASO 4",
        "StepFourSubText":"Conecte el cable de alimentación blanco (que viene incluido) a la parte inferior del Amplificador de Señal y luego a la fuente de alimentación. Enchufe la fuente de alimentación en el enchufe identificado en el Paso 2. El sistema tardará un par de minutos en encenderse y optimizarse. Cuando vea la luz azul, es que ya está listo.",
        "StepOne":"PASO 1",
        "StepThree":"PASO 3",
        "StepThreeSubText":"El soporte del Amplificador de Señal puede instalarse tanto sobre una superficie plana como en una esquina, pero el sistema funciona mejor si se lo instala en una esquina. Puede usar la cinta doble faz o el juego de tornillos que vienen incluidos (no es necesario usar los dos). Coloque el Amplificador de Señal en el soporte, asegurándose de que el logo del frente quede derecho.",
        "StepTwo":"PASO 2",
        "StepTwoSubText":"Recuerde: el Amplificador de Señal debe ser colocado donde haya mayor intensidad de señal celular. Lo mejor es instalarlo sobre una pared, en la parte más alta y en sentido vertical para que funcione normalmente. Debe haber un enchufe a menos de 5 metros del Amplificador de Señal. Funciona mejor cuando la fuente de alimentación está a la mayor distancia posible.",
