        "ThisIsAConsumerDevice":"Este es un dispositivo para consumidores ",
        "ThisIsAConsumerDevice1":"cumple con los requisitos establecidos en CPC-2-1-05.",
        "ThisIsAConsumerDevice2":"Debe utilizar este dispositivo con antenas y cables aprobados según lo especificado por el fabricante. La antena DEBE instalarse a una distancia mínima de 20 cm (8 pulgadas) de cualquier persona. Debe dejar de operar este dispositivo de inmediato si lo solicita FCC, Innovación, Ciencia y Desarrollo Económico de Canadá o un proveedor de servicios inalámbricos con licencia.",
        "ThisIsAConsumerDevice3":"Es posible que la información de ubicación no se pueda proporcionar o sea inexacta para las llamadas realizadas a través de este dispositivo.",
        "ThisIsAConsumerDevice4":"ANTES DE USAR, DEBE REGISTRAR ESTE DISPOSITIVO con su operador de servicios inalámbricos y obtener su consentimiento. Muchos operadores móviles están de acuerdo con el uso de los Amplificadores de Señal de usuario. Algunos operadores pueden no consentir el uso de este dispositivo en su red. Si no está seguro, póngase en contacto con su proveedor. ",
