        "TroubleShootingPrimeBlinkingBlue":"El Indicador de Estado parpadea en azul",
        "TroubleShootingPrimeFlashingRed":"Mi indicador de estado está parpadeando en rojo",
        "TroubleShootingPrimeSolidBlue":"La luz del Indicador de Estado está fija en azul pero mi teléfono sigue teniendo mala señal ",
        "TroubleShootingPrimeSolidRed":"La luz del Indicador de Estado está fija en rojo",
        "TroubleShootingPrimeSolidRedDescription":"Hay varias razones por las que el led Indicador de Estado luce rojo fijo. La mejor manera de determinar la razón específica de su luz roja es utilizar la aplicación WAVE para Móvil o Desktop mientras esté conectada a su dispositivo. Para obtener más información, consulte la lista de errores PRIME a continuación:",
        "TroubleShootingPrimeText1":"Asegúrese de que su toma de corriente funciona correctamente. Pruebe algo que sabe que funciona en la misma toma de corriente, o trate de mover la fuente de alimentación PRIME a otra toma que haya confirmado que funciona. ¿Sigue sin funcionar? Es posible que tenga una fuente de alimentación defectuosa o un mal funcionamiento de su hardware Amplificador de Señal PRIME. Por favor, acérquese a su punto de venta para obtener más instrucciones.",
        "TroubleShootingPrimeText2":"Si ha cambiado las fuentes de alimentación y ambos sistemas funcionan correctamente, entonces su sistema Cel-Fi PRIME simplemente necesitaba reiniciarlo. Esto no es algo que deba suceder de nuevo, pero si ocurre con frecuencia, por favor póngase en contacto con su punto de venta para obtener ayuda. Si tiene encendida su Unidad de Red con  pantalla en blanco o de otro modo anormal, póngase en contacto con su punto de venta para obtener soporte específico de la garantía.",
        "TroubleShootingPrimeText3":"Si el Indicador de Estado parpadea en azul significa que su Cel-Fi PRIME todavía está en proceso de inicio. Dependiendo de la complejidad de su red celular, este proceso puede tardar un rato. Si el Indicador de Estado del Amplificador de Señal continúa parpadeando por más de 30 minutos, intente reiniciarlo.",
        "TroubleShootingPrimeText4":"Si la  luz del Indicador de Estado de su Cel-Fi PRIME está fija en azul, el sistema está funcionando correctamente.",
        "TroubleShootingPrimeText5":"Si la  luz del Indicador de Estado está fija en azul pero su teléfono no está captando una señal celular más fuerte, verifique las conexiones de los cables de alimentación y la compatibilidad de su teléfono con la red seleccionada.",
        "TroubleShootingPrimeText6":"Algunos dispositivos celulares usan una combinación de diferentes factores para calcular la cantidad de \"barras\" que muestran. Para saber si la intensidad de su señal es más fuerte, puede observar la intensidad con el sistema PRIME enchufado y desenchufado. Para más información, por favor consulte en su punto de venta o visite ",
        "TroubleShootingPrimeText7":"Hay varias razones por las que su Indicador de Estado parpadea en rojo. La mejor manera de determinar la razón específica de su luz intermitente es utilizar la aplicación WAVE para Móvil o Desktop mientras esté conectada a su dispositivo. Para obtener más información, consulte la lista de errores PRIME a continuación:",
