        "InstallationGuideForPro":"Guide d'installation pour Cel-Fi PRO",
        "InstallationGuidePrime":"Guide d'installation",
        "InstallationProStepFourSubText":"Pour de meilleurs résultats, essayez de déplacer l'unité de couverture dans différents endroits. En règle générale, plus les unités sont éloignées, meilleure sera votre couverture. Toutefois, il est aussi possible de trop éloigner les unités.",
        "InstallationProStepOneSubText":"Pour que Cel-Fi fonctionne correctement, utilisez votre téléphone pour localiser le meilleur signal 3G, 4G ou LTE. En règle générale, vous obtiendrez le meilleur signal à l'étage, près d'une fenêtre.",
        "InstallationProStepThreeSubText":"Placez l'unité de couverture (CU) à l'endroit où vous avez besoin d'une meilleure couverture.",
        "InstallationProStepTwoSubText":"Placez l'Unité réseau (NU) à l'endroit où vous obtenez le meilleur signal cellulaire.",
        "InstalledCelFiDonNotSeeMyPhone":"J'ai installé Cel-Fi, mais je ne vois pas de barres supplémentaires sur mon téléphone?",
        "InstalledCelFiDonNotSeeMyPhoneAnswer1":"Il peut y avoir plusieurs raisons à cela : D'abord, vous pouvez essayer de redémarrer votre téléphone en le plaçant à proximité de l'Unité de couverture, de façon à ce qu'il détecte de nouveau les canaux disponibles. Vérifiez également que votre téléphone est compatible avec les canaux que votre modèle Cel-Fi amplifie (peut-être votre combiné est-il « déverrouillé » et ne supporte pas entièrement tous les canaux de votre opérateur actuel). Les iPhones peuvent également afficher moins de « barres » de signal si le réseau est très chargé (cliquez ici pour en savoir plus).",
        "InstalledCelFiDonNotSeeMyPhoneAnswer2":"Notez que les modèles Cel-Fi RS1 et RS2 ne prennent pas en charge le réseau LTE. Si votre téléphone est doté d'une compatibilité LTE et ne montre pas d'amplification du signal, il est, au besoin, conçu pour passer à des services non-LTE lorsque nécessaire, tel que lors d'un appel. Cela s'applique avec ou sans Cel-Fi, et ce qui importe c'est que vous bénéficiez maintenant d'un service fiable où vous en avez besoin!",
        "InstalledCelFiDonNotSeeMyPhoneAnswer3":"Si vous voulez aussi bénéficier des avantages du service LTE, vous pouvez toujours mettre à jour votre Cel-Fi pour obtenir une version plus récente qui supporte également le LTE.",
        "Installing":"Installation",
        "Installingupdate":"Installation mise à jour",
        "InstallServiceAntenna":"Installez l'antenne de service",
        "IsCelFiCarrierOperatorSpecific":"Est-ce que Cel-Fi est conçu pour un fournisseur / opérateur spécifique ?",
        "IsCelFiCarrierOperatorSpecificAnswer1":"Oui, pour des fins d'efficacité ! Cel-Fi est contrôlé par le réseau d'un opérateur, et fonctionne en guise d'extension de celui-ci. Cela permet à Cel-Fi (grâce à l'autorité réglementaire) d'amplifier les signaux 1000x plus que les autres solutions, ce qui permet de couvrir de très grandes surfaces, même si le signal réseau d'origine est faible. Tout cela fonctionne très bien.",
        "IsCelFiCarrierOperatorSpecificAnswer2":"Les répéteurs à large spectre peuvent causer des interférences et des dommages aux réseaux. Pour cette raison, les opérateurs ont adopté une politique stricte contre l'utilisation des amplificateurs de signal existants sur leurs propres réseaux. Cependant, Cel-Fi (le seul amplificateur de signal intelligent du genre), est autorisé pour une utilisation par les fournisseur,  et est autorisé sur leur spectre sous licence sans affecter la performance pour les autres utilisateurs.",
        "IsItLegalToUseSigBoosters":"Est-il légal d'utiliser des amplificateurs de signal?",
        "IsItLegalToUseSigBoostersAnswer":"Cel-Fi répond aux exigences réglementaires les plus récentes qui permettent l'usage d'un amplificateur (les amplificateurs qui ne répondent pas à ces exigences, soit la grande majorité de ces derniers, sont désormais illégaux). Vous pouvez en apprendre plus sur la FCC en lisant son nouveau rapport et l'ordonnance sur les amplificateurs de signal. Selon ces nouveaux règlements, les consommateurs doivent obtenir la permission de leur fournisseur avant d'utiliser un amplificateur. Les amplificateurs pour consommateurs vendus après le 1er mars 2014, en plus de certains datant d'avant cette date, portent une étiquette indiquant qu'ils répondent aux nouvelles réglementations de la FCC.",
        "IsItNeccessaryToRegister":"Est-il nécessaire d'enregistrer mon Cel-Fi ?",
        "IsItNeccessaryToRegisterAnswer1":"Si l'enregistrement de l'amplificateur est nécessaire dans votre pays, votre système peut arriver pré-enregistré, ou bien il pourrait vous être demandé de l'enregistrer (c'est très simple). Consultez la notice du produit pour plus de détails.",
        "IsItNeccessaryToRegisterAnswer2":"La FCC demande aujourd'hui à ce que tous les amplificateurs aux U.S. soient approuvés par les opérateurs avant utilisation. Pour en savoir plus visitez le site de la FCC:",
