        "LocationServices":"Services de location",
        "LocationServicesIos":"Les organismes de réglementation et / ou les opérateurs de réseau de téléphonie mobile imposent de connaître l'emplacement des boosters en cas de problème de réseau. Toutes les informations collectées via cette application sont conservées à titre privé et sont soumises à la politique de confidentialité de Cel-Fi.",
