        "MountTheSystemContent":"Le support de montage pour l'amplificateur de signal peut être installé sur une surface plane ou dans un coin. Utilisez soit le ruban double face fourni ou un kit de vis (vous n'avez pas besoin d'utiliser les deux à la fois). Si vous utilisez le ruban adhesif, assurez-vous qu'il dépasse sous le support pour un démontage plus facile. Fixez l'amplificateur de signal sur le support de montage. Rappelez-vous de vous assurer que l'appareil soit monté verticalement.",
