        "NotreceivingsignalE1":"Ne reçoit pas de signal (E1)",
        "NotreceivingsignalE1Sub":"Le signal cellulaire est probablement trop faible pour être amplifié.<br> Essayez notre outil de recherche de signal afin de localiser le meilleur endroit où placer votre Unité de réseau.",
        "NoWiFiCell":"Pas de réseau wifi ou cellulaire",
        "NoWiFiCellSub1":"Impossible de se connecter au cloud, pas de réseau wifi ou cellulaire disponible.",
        "NUHardWareError":"Erreur 6 : Erreur matérielle de l'Unité réseau",
        "NUHardWareErrorSub1":"Votre Unité réseau est peut-être affectée par une erreur matérielle qui pourrait être corrigée par une réinitialisation. Essayez ceci ... réinitialisez votre Unité réseau. Il suffit de débrancher votre Unité réseau pendant quelques secondes et de la rebrancher. Si le problème persiste après un redémarrage, veuillez contacter votre point de vente pour obtenir de l'aide.",
        "NumDisplayCycling":"Affichage numérique en cours de cycle / rotation",
        "NURedErrorMessage":"Message d'erreur rouge Unité réseau",
        "NUTroubleShooting":"Dépannage de l'unité réseau",
        "NUTroubleShootingLine1":"Lorsque votre système ne démarre pas, l'une des choses suivantes pourraient se produire. Une défaillance de l'adaptateur secteur ou  une défaillance matérielle pourrait être présente, ou le système pourrait avoir besoin d'un simple redémarrage. Essayez ceci ... Tant l'unité de couverture et de l'unité réseau ont des prises d'alimentation identiques. Essayez d'inverser les blocs d'alimentation pour voir si l'un des problèmes suivants pourraient être présent :",
        "NUTroubleShootingLine10":"Assurez-vous que votre unité de couverture (CU) est branchée et alimentée. Si votre unité de couverture n'a pas d'alimentation, cliquez ici pour un lien vers la section de dépannage de l'unité PRO de couverture (CU).",
        "NUTroubleShootingLine11":"Assurez-vous que vos unités ne sont pas trop éloignées. Essayez de placer les systèmes de 10 à 15 pieds de distance pour vous assurer qu'ils puissent se connecter. Plus il y a d 'interférences (c'est-à-dire des murs, portes, réfrigérateurs, classeurs) entre les deux unités, plus elles devront être rapprochées. Une fois que vous avez établi une connexion, vous pouvez optimiser le chiffre affiché en déplaçant l'unité.",
        "NUTroubleShootingLine12":"Problématiques \"trop loin\" intermittentes. Le nombre 9 est la plus grande distance possible entre votre unité de couverture et votre Unité réseau, mais il est possible que les systèmes soient légèrement trop éloignés. Cela peut provoquer de l'interférence intermittente, qui peut entrainer une rupture de la connexion . Les problématiques  fréquentes ou intermittentes peuvent être liées à une forte saturation du WiFi dans votre maison / bureau, ou à des obstacles dans la trajectoire entre les deux unités. Assurez-vous que chaque unité est aussi loin que possible de tous les points d'accès ou autres appareils avec WiFi activé. Un exemple de dispositif sans fil peut être, sans s'y limiter, un téléphone sans fil domiciliaire, un ordinateur portable ou un routeur sans fil.",
        "NUTroubleShootingLine2":"Si vous inversez les prises d'alimentation et que le problème se transfère d'une unité vers l'autre, il s'agit d'un problème d'alimentation. Veuillez contacter votre point de vente pour  obtenir une prise d'alimentation de rechange.",
        "NUTroubleShootingLine3":"Si, après l'inversion des prises d'alimentation, aucune alimentation n'est présente sur votre unité réseau, essayez une autre prise, ou une autre lampe / appareil dans la même prise. Si vous continuez à rencontrer des problèmes avec l'unité, veuillez contacter votre point de vente pour faire remplacer le système.",
        "NUTroubleShootingLine4":"Si, après l'inversion des prises d'alimentation, le système fonctionne correctement, alors votre système Cel-Fi PRO a tout simplement besoin d'un redémarrage. Cela ne se produit pas fréquemment, mais si c'est le cas, veuillez contacter votre point de vente pour assistance.",
        "NUTroubleShootingLine5":"Si vous n'obtenez aucune barre, votre Unité Réseau est toujours à la recherche d'un signal de réseau cellulaire disponible. Il se peut que votre Unité Réseau affiche le message \"Searching for the Network...\". Cela peut parfois prendre pas mal de temps. <br><br>nécessitant plus de 60 minutes? Essayez ceci...",
        "NUTroubleShootingLine6":"Marchez autour de la maison / du bureau avec votre appareil cellulaire. Essayez de trouver un endroit avec au moins une barre constante de 3G / 4G / LTE; plus il y a de barres, mieux c'est! Une fois que vous avez trouvé un signal utilisable, placez votre Unité réseau à cet endroit.",
        "NUTroubleShootingLine7":"Si vous avez des barres de service sur votre téléphone à l'emplacement de votre Unité reseau et qu'aprés 60 minutes vous êtes toujours dans l'impossibilité de recevoir des barres de service sur votre Unité réseau, essayez un simple redémarrage. Pour redémarer votre unité réseau, débranchez-la pendant un petit moment puis rebranchez-la. Si le redémarrage ne résout pas le probleme, veuillez contacter votre point de vente pour assistance.",
        "NUTroubleShootingLine7a":"L'Unité réseau (NU) continue à chercher l'unité de couverture (CU)",
        "NUTroubleShootingLine8":"Votre Cel-Fi PRO a trouvé le réseau et affiche des barres sur l'ecran de l'unité Réseau (NU), mais continue à essayer de trouver une connexion à l'unité de couverture (CU).",
        "NUTroubleShootingLine9":"Si cet écran s'affiche pendant plus de 30 minutes, après que votre Unité ait affiché des barres, il peut s'agir de l'un des problèmes suivants avec votre Cel-Fi système PRO.",
