        "RegistrationError":"Erreur d'enregistrement",
        "RegistrationErrorSub1":"Erreur d'enregistrement de l'utilisateur.",
        "RegistrationErrorSub2":"Veuillez s'il vous plaît contacter votre fournisseur de réseau.",
        "RegistrationLine1":"Dans certains cas, les organismes de réglementation et/ou les opérateurs de réseaux mobiles peuvent obliger les utilisateurs à enregistrer leur amplificateur de signal.",
        "RegistrationLine2":"Les informations recueillies lors de l'enregistrement comprennent les coordonnées de l'utilisateur, l'adresse où l'amplificateur est utilisé, la marque de l'amplificateur, son modèle et son numéro de série. Ces informations permettront au fournisseur de communiquer avec les utilisateurs ou de localiser l'amplificateur en cas de problèmes réseau. Toute information recueillie par le biais de ce programme sera utilisée tel qu'énoncé ci-dessus, et est soumise à la Politique de confidentialité de Cel-Fi",
        "RegistrationPrivacyText":"Chez Nextivity, nous prenons votre vie privée au sérieux et n'utiliserons vos informations personnelles que pour administrer votre compte et vous fournir les produits, services et support que vous nous avez demandés. <br> <br> Veuillez noter que nous ne fournissons jamais vos informations personnelles à des tiers.",
        "RegistrationSignalBoosters":"Enregistrement des amplificateurs de signal",
        "RegistrationSignalBoostersSub1":"Dans certains cas, les organismes de réglementation et ou les opérateurs de réseaux mobiles peuvent obliger les utilisateurs à enregistrer leur amplificateur de signal. Il se peut que vous deviez ré-enregistrer l'emplacement des amplificateurs s'ils sont déplacés vers une adresse différente.",
