        "SharingPersonalInfo":"Partage de renseignements personnels",
        "SharingPersonalInfoSub":"Les Opérateurs téléphonique tels que AT&T ou T-Mobile ( un \“opérateur\”) peut demander en vertu de la loi applicable (par exemple, 47 CFR 20.21(h) au Etats-Unis) d'enregistrer les utilisateurs d'un produit Nextivity. Si, par le biais des Services, vous choisissez (i)d'enregistrer votre produit Nextivity auprès d'un opérateur ou (ii) de créer un compte sur le WavePortal Cel-Fi, nous pouvons alors être ammenés à divulguer des renseignements personnels en rapport avec cet enregistrement ou création de compte ou les informations relatives a votre géo-localisation basées sur l'utilisation de votre produit Nextivity à cet opérateur ou à ses filiales ou les distributeurs ou revendeurs par le biais desquels vous avez acheté un Produit Nextivity (\"Distributeurs\" en général).Par exemple, nous pourrions divulguer votre nom, votre adresse résidentielle, votre adresse email, numéro de téléphone, numéro de Fax, la géo-localisation de votre Produit Nextivity, et/ou le numéro d'identification de votre Produit Nextivity aux dits Opérateurs. Dans le cas ou vous avez acheté votre produit Nextivity par l'intermédiaire d'un distributeur Nextivity autorisé (\"Distributeurs\"), dans ce cas nous pouvons être ammenés à partager les dites informations avec ce Distributeur. Nous n'avons aucun contrôle sur les politiques de protection de la vie privée de ces Opérateurs ou Distributeurs, Leur utilisation ou divulguation de vos informations personnelles ou quoique ça soit d'autre. Ainsi, si vous choisissez d'enregistrer votre Produit Nexitivy avec un Opérateur ou d'acheter votre Produit Nexitivity par l'intermédiaire d'un distributeur, veuillez s'il vous plait consulter toutes les politiques de vie privée de cet Opérateur et/ou Distributeur. A titre indicatif, et sans limitations quant à l'usage qu'un Opérateur ou un Distributeur peut faire de vos informations personnelles, veuillez accepter le fait que les Opérateurs et Distributeurs peuvent être soumis à la divulgation de vos information personnelles par la loi en vigueur. En partageant vos informations personnelles avec nous en relation avec l'enregistrement d'un Produit Nextivity ou en créant un compte sur le WavePortal, vous acceptez de dégager Nextivity de toute responsabilité quant à la divulgation, l'usage ou la protection de ces informations personnelles par un Opérateur, Distributeur ou leurs agents.",
        "SharingPersonalInfoSub2":"Nous pourrions anonymiser vos renseignements personnels afin que vous ne puissiez pas être identifié individuellement, et fournir ces informations à nos partenaires ou d'autres tiers. Nous pourrions également utiliser vos renseignements personnels sur une base regroupee pour améliorer nos produits, services et les offres relatives à ces derniers. Cependant, nous ne divulguons jamais d'informations regroupées à un partenaire ou un tiers qui pourraient vous identifier personnellement, en tant qu'individu",
        "SharingPersonalInfoSub3":"Nous sommes basés aux Etats-Unis, endroit où les renseignements personnels que vous nous fournissez sont stockés et traités. En nous fournissant des informations personnelles en relations avec les Services, vous acceptez le transfer et le traitement de telles informations aux Etats-Unis. Nous utiliserons les informations que vous nous fournirez pour superviser les conditions opérationelles de votre Produit Nextivity. Si à tout moment vous désirez que nous stoppions la supervision de votre Produit Nextivity, veuillez nous contacter à support@cel-fi.com.",
        "ShowMeHow":"Montrez-moi comment faire",
        "SkalErrorHead0":"E1: Erreur de capteur de rotation",
