        "StepFourSubText":"Branchez le câble d'alimentation blanc (fourni) au bas de l'amplificateur de signal, puis à la prise d'alimentation. Branchez le bloc d'alimentation dans la prise identifiée à l'étape 2. Il faudra au système quelques minutes pour s'allumer et s'optimiser. Quand la lumière bleue s'allume, tout est prêt.",
        "StepOne":"ÉTAPE 1",
        "StepThree":"ÉTAPE 3",
        "StepThreeSubText":"Le support de montage pour l'amplificateur de signal peut être installé sur une surface plane ou dans un coin. Le système fonctionne généralement mieux lorsqu'il est placé dans un coin. Utilisez soit le ruban double face fourni ou un kit de vis (vous n'avez besoin d'utiliser les deux à la fois). Fixez l'amplificateur de signal sur le support de montage. Assurez-vous que le logo devant l'appareil est en position verticale.",
        "StepTwo":"ÉTAPE 2",
        "StepTwoSubText":"Rappelez-vous, l'amplificateur de signal doit être placé là où le signal cellulaire est le plus fort. Il est préférable de le placer en hauteur sur le mur, et de l'installer verticalement afin qu'il fonctionne normalement. Il doit y avoir une prise de courant à moins de 5 mètres de l'amplificateur de signal mais le rendement est meilleur lorsqu'il y a de la distance entre les 2.",
