        "TroubleShootingPrimeSolidRedDescription":"Il y a plusieurs raisons pour lesquelles votre lumière d'état peut être rouge. La meilleure façon de déterminer la raison spécifique de cette lumière clignotante est d'utiliser l'application WAVE de bureau mobile tout en étant connecté à votre appareil. Pour plus d'informations sur Cel-Fi WAVE veuillez visitez le",
        "TroubleShootingPrimeText1":"Assurez-vous que la source d'alimentation est une source d'alimentation fonctionnelle. Testez avec un autre appareil en etat de fonctionnement dans la même source d'alimentation, ou essayez de déplacer l'unité PRIME vers une autre source d'alimentation que vous avez testée au préalable. Il est possible que vous ayez une source d'alimentation défectueuse ou que votre amplicateur de Signal Prime ait une défaillance Matérielle. Veuillez s'il vous plaît contacter votre point de vente pour de plus amples instructions.",
        "TroubleShootingPrimeText2":"SI vous avez changé de source d'alimentation et que votre système Cel-Fi PRIME ne fonctionne toujours pas correctement il est possible que vous ayez tout simplement besoin de redémarrer l'appareil. Ce n'est pas quelque chose qui devrait persister; cependant, si cela devait se reproduire fréquemment, veuillez s'il vous plait contacter votre point de vente pour assistance. Si vous avez du courant sur votre unite Network avec un affichage blanc ou de couleur anormale sur l'ecran, veuillez contacter votre point de vente pour assistance avec la guarantie specifique.",
        "TroubleShootingPrimeText3":"Un indicateur d'état clignotant en bleu signifie que votre Cel-Fi PRIME est encore en processus de démarrage. Selon la complexité de votre réseau cellulaire, ce processus peut prendre un certain temps. Si l'indicateur d'état de l'amplificateur de signal continue de clignoter pendant plus de 30 minutes, veuillez tenter un redémarrage.",
        "TroubleShootingPrimeText4":"Si votre amplificateur de signal Cel-Fi PRIME a un indicateur d'état présentant une lumière bleue en continu, le système est entièrement fonctionnel.",
        "TroubleShootingPrimeText5":"Si l'indicateur lumineux de votre système est bleu en continu, mais que votre téléphone ne capte pas un signal cellulaire plus fort, il se peut que vous deviez vérifier les connexions du câble d'alimentation et la compatibilité de votre téléphone avec le réseau sélectionné.",
        "TroubleShootingPrimeText6":"Certains appareils cellulaires utilisent la combinaison de nombreux facteurs pour calculer le nombre de «barres» affichées. Afin de déterminer si la puissance du signal est plus grande, vous pouvez vérifier la force de votre signal alors que le PRIME est branché puis lorsqu'il est debranché. Pour plus d'informations, veuillez contacter votre point de vente ou visitez",
        "TroubleShootingPrimeText7":"Il y a plusieurs raisons pour lesquelles votre lumière d'état peut être rouge. La meilleure façon de déterminer la raison spécifique de cette lumière clignotante est d'utiliser l'application WAVE de bureau mobile tout en étant connecté à votre appareil. Pour plus d'informations veuillez consulter la liste d'erreur ci-dessous:",
