        "Welcome":"Bienvenue",
        "WhatCelFiDifferentFromOtherSignal":" Qu'est-ce qui rend Cel-Fi si différent des autres amplificateurs de signal ?",
        "WhatCelFiDifferentFromOtherSignalAnswer":"Cel-Fi est un amplificateur de signal ingénieux. Cela signifie qu'il repose sur des algorithmes d'organisation automatique intelligents pour vous assurer de bénéficier de la plus grande zone de couverture sans compromettre ou interférer avec les réseaux de votre opérateur mobile ou perturber les signaux des autres abonnés. Cel-Fi ne nécessite aucun nouvel équipement, aucune configuration, ou modification apportée à l'infrastructure réseau existante ou aux appareils mobiles.C'est également un dispositif  \"plug and play\", ce qui signifie qu'aucune installation professionnelle n'est requise, ni aucun perçage ou câblage. En outre, Cel-Fi est reconnu pour ses conception et  efficacité supérieures, et il constitue le seul amplificateur dont l'utilisation est autorisée par les commissions de communication de l'Australie et du Royaume-Uni, et le seul amplificateur intelligent conçu pour répondre aux nouvelles spécifications \"Port FCC Safe 2\" qui permettent un gain très élevé (un gain très élevé de signal est nécessaire pour rendre les signaux de faible niveau utilisables dans une grande zone de couverture).",
        "WhatCoverageFromCelFiSystem":"À quelle couverture puis-je m'attendre avec le système Cel-Fi ?",
        "WhatCoverageFromCelFiSystemAnswer1":"Le rayon (la moitié de la largeur) du cercle de couverture est environ la distance entre l'unité de couverture et l'Unité réseau (fenêtre). Voici quelques exemples :",
        "WhatCoverageFromCelFiSystemAnswer2":"Rayon = 20 mètres (66 pieds)pour des murs avec structure en bois.",
        "WhatCoverageFromCelFiSystemAnswer3":"Le rayon est inférieur pour des murs intérieurs en béton.",
        "WhatCoverageFromCelFiSystemAnswer4":"Le rayon peut aisément dépasser 65 mètres (200 pieds)  dans le cas d'un local commercial ouvert.",
        "WhatDataCollected":"Quelles données sont recueillies ?",
        "WhatDataCollectedAnswer":"Les informations recueillies lors de l'enregistrement comprennent les coordonnées de l'utilisateur, l'adresse où l'amplificateur est utilisé, la marque de l'amplificateur, son modèle et son numéro de série. Ces informations permettront au fournisseur de communiquer avec les utilisateurs ou de localiser l'amplificateur en cas de problèmes réseau. Toute information recueillie par le biais de ce programme sera utilisée tel que décrit ci-dessus et est soumise à la Politique de confidentialité de Cel-Fi",
        "WhatDataCollectedAnswerSub":"Pour plus d'informations et de vidéos utiles sur l'installation et l'enregistrement de votre amplificateur Cel-Fi, veuillez visitez le",
        "WhatFrequenciesLinkTheNW":"Quelles sont les fréquences reliant l'unité réseau (Fenêtre) et l'unité de couverture?",
        "WhatFrequenciesLinkTheNWAnswer":"Cel-Fi sélectionne automatiquement des canaux clairs et inutilisés de bandes UNII (5.15-5.35 GHz, 5,47 à 5,725 GHz et 5725-5825 GHz) pour la communication entre l'unité Réseau et l'Unité de couverture. Même si, dans certains cas, ce sont les mêmes fréquences que pour le Wi-Fi, le système Cel-Fi utilise un protocole propriétaire de communication qui est conçu pour fonctionner harmonieusement avec les périphériques sans fil existants, tels que les routeurs Wi-Fi, téléphones sans fil ou moniteurs pour bébés.",
        "WhatIsCelFi":"Qu'est-ce que Cel-Fi ?",
        "WhatIsCelFiAnswer":"Cel-Fi est la marque de solutions de couverture intérieure à configuration automatique et soucieuse de l'environnement de Nextivity. Chaque système Cel-Fi est composé de deux unités. L'Unité réseau est placée dans la zone où un signal natif plus fort peut être obtenu à partir du réseau de l'opérateur (des niveaux de signal aussi faible que -120 dBml sont acceptables). L'Unité réseau comprend un émetteur et un récepteur qui communiquent avec la tour cellulaire. L'unité de couverture est placée au centre de la maison, et communique via wifi avec l'Unité réseau et alimente l'intérieur de la maison avec des niveaux de signal significativement rehaussés, permettant ainsi de appels de meilleure qualité et un plus grand débit de données.",
        "WhatIsIntelliBoost":"Qu'est-ce qu'IntelliBoost ?",
        "WhatIsIntelliBoostAnswer":"Le processeur Nextivity IntelliBoost Baseband est le premier processeur conçu spécifiquement pour optimiser la transmission intérieure et la réception des signaux sans fil 3G et 4G / LTE signaux sans fil. Avec un filtrage avancé, l'égalisation et les techniques d'annulation d'écho, Nextivity a développé une architecture embarquée qui délivre des débits de données sans précédent dans les batiments et difuse largement la connectivité 3G et 4G /LTE. Le processeur IntelliBoost garantit que les produits Cel-Fi n'ont jamais un impact négatif sur le réseau macro tout en offrant une couverture maximale.",
        "WhatTechnologiesCelFiSupport":"Quelles technologies sont supportées par Cel-Fi ?",
        "WhatTechnologiesCelFiSupportAnswer1":"Le système Cel-Fi supporte le 3G (UMTS / WCDMA), 4G (HSPA / HSPA +) et LTE.",
        "WhatTechnologiesCelFiSupportAnswer2":"Chaque système Cel-Fi est différent. Vérifiez votre boîte pour un guide de démarrage rapide, ou visitez la section Support de notre site Web pour obtenir des renseignements plus précis sur votre produit.",
        "WhyDoesntWorkWithDifferentOperators":"Pourquoi Cel-Fi ne fonctionne-t-il pas auprès de différents opérateurs ?",
        "WhyDoesntWorkWithDifferentOperatorsAnswer":"Tous les opérateurs de téléphonie mobile n'utilisent pas les mêmes technologies, et nous n'amplifions pas toutes les technologies disponibles dans le monde entier. Les systèmes Cel-Fi supporte le 3G (UMTS / WCDMA), 4G (HSPA & HSPA +), et la technologie LTE des opérateurs qui ont approuvé l'utilisation de Cel-Fi sur leur réseau. Vous pouvez contacter votre opérateur pour plus d'informations sur la technologie spécifique utilisée par ces derniers.",
        "WhyDoIHaveToRegister":"Pourquoi dois-je enregistrer mon Cel-Fi ?",
        "WhyDoIHaveToRegisterAnswer":"Pourquoi est-ce requis ? Parce que les systèmes cellulaires sont protegés par les opérateurs qui en sont les propriétaires. De nombreux amplificateurs sur le marché causent des problèmes sur les réseaux (et ainsi que pour l'ensemble d'entre nous qui utilisons ces réseaux). Les nouveaux amplificateurs approuvés par le FCC / les opérateurs sont meilleurs et ne causent pas de problèmes, et Cel-Fi offre la seule catégorie d'amplificateur qui permet des gains de signal de 100 dB (contre 30 dB ou 1000x le gain  des autres amplificateurs).",
        "WhyRegister":"Pourquoi s'enregistrer",
        "WhyToRegister":"Pourquoi dois-je m'enregistrer ?",
        "WillCelFiSupportVoiceAndData":"Est-ce que Cel-Fi supporte la voix et les données ou les données seulement ?",
        "WillCelFiSupportVoiceAndDataAnswer":"Oui, les amplificateurs intelligents de signal Cel-Fi peuvent soutenir à la fois la voix et les données simultanément. Notez que les modèles Cel-Fi RS1 et RS2 ne prennent pas en charge le réseau LTE.",
        "WirelessLinkDown":"Liaison wifi en panne",
        "WirelessLinkDownSub1":"Le lien sans fil entre l'Unité réseau et de l'unité de couverture est en panne. Veuillez attendre la connexion du lien pour essayer à nouveau.",
