        "DuoCUTroubleShootingLine1":"Если электропитание отсутствует, ваша система не включается или засветился красным индикатор питания, то могло случиться следующее. Возможно, произошел сбой в работе адаптера питания, аппаратный сбой, или просто необходимо перезагрузить систему.",
        "DuoCUTroubleShootingLine10":"Чем больше вертикальных полос, отображаемых на Блоке сети (NU), тем лучше. Попробуйте переместить Блок сети (NU) в зону лучшего уровня покрытия сети 3G/4G/LTE. Если в здании дома/офиса расположено больше 1 лестничного пролёта, то там уровень покрытия, как правило, выше, чем на нижних этажах. Размещение Блока сети (NU) у окна или выше на полке часто хорошо помогает.",
        "DuoCUTroubleShootingLine11":"Числовое значение на дисплее Блока покрытия (CU) означает индикацию зоны покрытия. Большее число означает большую площадь покрытия. Чтобы увеличить площадь покрытия, переместите Блок покрытия (CU) подальше от Блока сети (NU). Чем меньше препятствий в зоне прямой видимости между ними, тем дальше друг от друга их можно разместить. Чем выше число на Блоке покрытия (CU), тем лучше уровень покрытия.",
