        "SharingPersonalInfoSub2":"Мы можем обезличить вашу персональную информацию, таким образом, чтобы вас нельзя было обособленно идентифицировать, и предоставлять информацию в таком виде нашим партнерам или другим третьим лицам. Мы также можем использовать вашу персональную информацию, обобщив её, с целью повышения качества нашей продукции, услуг и предложений. Тем не менее, мы никогда не разглашаем обобщённую информацию партнерам или третьим лицам в порядке, позволяющем идентифицировать вас персонально, как личность.",
        "SharingPersonalInfoSub3":"Персональная информация, собранная на всех без исключения веб-сайтах Nextivity может храниться и обрабатываться на территории Соединенных Штатов или любой другой страны, на территории которой Nextivity или её филиалы, дочерние компании или агенты содержат линии связи и техническое оборудование. Используя этот сайт или наши Сервисы, вы тем самым даёте своё согласие на передачу информации за пределы вашей страны.",
