        "StepThree":"ШАГ 3",
        "StepThreeSubText":"Монтажный кронштейн для Усилителя сигнала может быть установлен либо на плоской поверхности, либо в углу. Как правило, наилучшие эксплуатационные свойства система демонстрирует, когда расположена в углу. Используйте либо прилагаемый двусторонний скотч, либо комплект винтов (выберите только один из предложенных вариантов). Прикрепите Усилитель сигнала к монтажному кронштейну. Убедитесь, что логотип на передней панели устройства расположен вертикально.",
