        "DuoCUTroubleShootingLine10":"网络单元显示的信号格数越多越好。请尝试将网络单元移动到3G、4G或LTE信号更强的区域。如果您的住所或办公室高于一层，通常楼上的信号比楼下的强。将网络单元置于临窗或柜子顶端通常效果更佳。",
        "DuoCUTroubleShootingLine11":"覆盖单元上显示的数值表示覆盖区域的大小，数值越高表示覆盖的区域越大。为了扩大覆盖区域，请将覆盖单元移动到离网络单元尽可能远的地方。两个单元间的障碍物越少，距离就可以越远。覆盖单元上显示的数值越高，信号覆盖情况就越好。",
