        "DuoCUTroubleShootingLine5":"如果在交换电源装置后两个系统都可以正常工作，那么您只需要重启一下Cel-Fi DUO系统。该问题应该不会再出现，但如果继续频繁发生，请及时到您的购买网点咨询。",
        "DuoCUTroubleShootingLine6":"当您的覆盖单元显示滚动的数值为“0”时，说明系统仍在启动中。启动时间通常不会超过20分钟，如果超过45分钟，请将两个单元重新启动。",
        "DuoCUTroubleShootingLine7":"当显示屏上显示的数值为“0”、“1”、“2”、“3”、“4”、“5”或“6”时，说明您的Cel-Fi DUO系统已经成功建立连接，但没有运行到最佳状态。请尝试：将覆盖单元和网络单元距离更远一些。如果在您的家中有特别需要增强信号的区域，请尝试颠倒网络单元与覆盖单元的安装顺序。先将覆盖单元置于您最想增强信号的位置，然后将网络单元放到尽量远但至少能接收到1格信号的位置。",
        "DuoCUTroubleShootingLine8":"如果您无法将两个单元距离更远，而且您的增强信号目的已达到，毋须一味追求更高的覆盖单元数值。",
        "DuoCUTroubleShootingLine9":"当显示屏上显示的数值为固定的“0”，并且电源指示灯闪绿色时，说明网络单元和覆盖单元距离过近。请尝试先移动覆盖单元，将两个单元距离更远一些。",
        "DuoCUTroubleShootingLine9sub":"您可以通过改变Cel-Fi的位置来改善3G、4G或LTE信号的覆盖情况。",
        "DuoErrorCellularSignal":"E1：信号过弱，无法增强。请尝试：在您的住所或办公室里持移动通信设备找到能接收到至少一格稳定3G、4G或LTE信号的位置，格数越多越好。将网络单元（又称窗口单元）放到此处。注意：如果安装了外接天线，请先检查天线连接。",
        "DuoErrorCuHeating":"E3：覆盖单元过热。请确保覆盖单元的通风口没有堵塞，并将其置于通风处。覆盖单元将在冷却后继续正常工作，正常工作温度范围为摄氏0到40度。注意：网络单元会持续搜索覆盖单元。正常工作温度范围为摄氏0到40度。",
        "DuoErrorHardwareError":"E2：覆盖单元可能出现硬件故障，可通过重启来解决。请尝试：重启覆盖单元。您只需将覆盖单元断电几秒后重新接入电源。如果重启后故障仍然存在，请及时联系您的购买网点以获得更多帮助。",
        "DuoErrorNuCloserToCellularTower":"E8：网络单元距离信号塔过近，这可能导致网络单元为减小网络干扰而降低输出功率（覆盖范围变小）。请尝试：将网络单元移动到其他位置，您可将其置于家中的另一侧。",
        "DuoErrorRegDevice":"E5：使用前您需要注册本设备并获得您的运营商的许可。您需要使用制造商指定的线缆来操作本设备。此外，您可通过WAVE应用进行注册。",
        "DuoErrorSysDisabled":"E7：系统被移动网络运营商禁用。请联系您的购买网点以获得更多帮助。",
        "DuoErrorTooClose":"距离过近，覆盖单元距离网络单元过近。请尝试先移动覆盖单元，将两个单元距离更远一些。网络单元距离覆盖单元越远，信号覆盖的区域就越大。",
        "DuoErrorTooFar":"距离过远，覆盖单元距离网络单元过远。请尝试先移动覆盖单元，将两个单元距离稍微近一些（1.5到3米）。间歇性“距离过远”信息，频繁或间歇性的出现上述问题可能是因为您住所或办公室的WiFi过强，或者因为两个单元间有障碍物移动。请确保每个单元都距离无限网络接入点或其他具有WiFi功能的设备足够远。闪烁的电源指示灯表示网络单元正持续搜索覆盖单元。闪烁或持续发亮的绿色电源指示灯和绿色的信号强度格表示网络单元正常工作。如果网络单元出现闪烁或持续发亮的红色电源指示灯，请联系您的购买网点以获得更多帮助。",
        "DuoTroubleShootingLine1":"以下原因可能导致您的系统未通电或者电源指示灯为红色。您可能遇到电源适配器或硬件故障，也可能只需要重启一下系统。",
        "DuoTroubleShootingLine10":"以下几个原因可能导致您的手机无法使用LTE服务：您不在LTE的服务区；您的Cel-Fi由于间歇性的网络故障没有接收到LTE信号；您的手机不支持LTE；您的手机与Cel-Fi DUO增强的信号频率不兼容。您需要查看网络单元上的显示以获得更多信息，点击此处（跳转至网络单元问题LTE部分）。",
        "DuoTroubleShootingLine11":"频繁或间歇性出现“距离过远”问题",
        "DuoTroubleShootingLine12":"间歇性出现滚动的数值或者“距离过远”的问题。数值为“9”表示覆盖单元和网络单元已距离最远，而您可能让它们距离过远了，这或许会导致因间歇性干扰而引起的连接中断。频繁或间歇性的出现上述问题可能是因为您住所或办公室的WiFi过强，或者因为两个单元间有障碍物移动。请确保每个单元都距离无限网络接入点或其他具有WiFi功能的设备足够远。无限网络设备包括但不限于无线家庭电话、笔记本电脑和无线路由器。",
        "DuoTroubleShootingLine2":"请尝试：覆盖单元和网络单元有相同的电源装置，请尝试交换一下电源装置看下面的情况是否会发生。",
        "DuoTroubleShootingLine2Sub2":"如果在交换电源装置后覆盖单元仍没有通电，请尝试换个电源插座或者接在其他能正常工作的灯具或电器的插座上。如果问题依旧没有解决，请及时到您的购买网点进行更换。",
        "DuoTroubleShootingLine2Sub3":"如果在交换电源装置后两个系统都可以正常工作，那么您只需要重启一下Cel-Fi DUO系统。该问题应该不会再出现，但如果继续频繁发生，请及时到您的购买网点咨询。",
        "DuoTroubleShootingLine3":"当您的覆盖单元显示滚动的数值为“0”时，说明系统仍在启动中。启动时间通常不会超过20分钟，如果超过45分钟，请将两个单元重新启动。",
        "DuoTroubleShootingLine4":"当显示屏上显示的数值为“0”、“1”、“2”、“3”、“4”、“5”或“6”时，说明您的Cel-Fi DUO系统已经成功建立连接，但没有运行到最佳状态。请尝试：将覆盖单元和网络单元距离更远一些。如果在您的家中有特别需要增强信号的区域，请尝试颠倒网络单元与覆盖单元的安装顺序。先将覆盖单元置于您最想增强信号的位置，然后将网络单元放到尽量远但至少能接收到1格信号的位置。",
        "DuoTroubleShootingLine5":"如果您无法将两个单元距离更远，而且您的增强信号目的已达到，毋须一味追求更高的覆盖单元数值。",
        "DuoTroubleShootingLine6":"当显示屏上显示的数值为固定的“0”，并且电源指示灯闪绿色时，说明网络单元和覆盖单元距离过近。请尝试先移动覆盖单元，将两个单元距离更远一些。",
        "DuoTroubleShootingLine7":"您可以通过改变Cel-Fi的位置来改善3G、4G或LTE信号的覆盖情况。",
        "DuoTroubleShootingLine8":"网络单元显示的信号格数越多越好。请尝试将网络单元移动到3G、4G或LTE信号更强的区域。如果您的住所或办公室高于一层，通常楼上的信号比楼下的强。将网络单元置于临窗或柜子顶端通常效果更佳。",
