        "ErrorDuoExternalDoorAntenna":"E2：覆盖单元可能出现硬件故障，可通过重启来解决。请尝试：重启覆盖单元。您只需将覆盖单元断电几秒后重新接入电源。如果重启后错误仍然存在，请及时联系您的购买网点以获得更多帮助。",
        "ErrorDuoNUHeating":"E4：网络单元（又称窗口单元）过热。请确保网络单元的通风口没有堵塞，并将其置于通风处。如果您将网络单元置于过热的区域，请及时将其放到阴凉处避免持续过热。网络单元将在冷却后继续正常工作,正常工作的温度范围为摄氏0到40度。",
