        "LocatePowerOutletContent":"将覆盖单元接入至第一步中找到的电源接口，然后等待系统完成启动。当您看到系统显示稳定的蓝光时，说明已启动完毕。上述电源接口不应位于如家具等大型物体的后面，否则会干扰信号。覆盖单元能在任何方向下正常工作。",
