        "NUHardWareError":"报错 6：网络单元硬件故障",
        "NUHardWareErrorSub1":"网络单元可能出现硬件故障，可通过重启来解决。请尝试：重启网络单元。您只需将覆盖单元断电几秒后重新接入电源。如果重启后错误仍然存在，请及时联系您的购买网点以获得更多帮助。",
        "NumDisplayCycling":"数字显示屏不断滚动",
        "NURedErrorMessage":"网络单元红色错误信息",
        "NUTroubleShooting":"网络单元故障排除",
        "NUTroubleShootingLine1":"以下原因可能导致您的系统未通电。您可能遇到电源适配器或硬件故障，也可能只需要重启一下系统。请尝试：覆盖单元和网络单元有相同的电源装置，请尝试交换一下电源装置看下面的情况是否会发生：",
        "NUTroubleShootingLine10":"请确认覆盖单元（CU）已连接电源线并且通电。如果覆盖单元仍未通电，请点击此链接跳转至PRO覆盖单元（CU）故障排除部分。",
        "NUTroubleShootingLine11":"请确保两个单元间距不要过远，3-5米左右的距离比较合适。单元间的有越多障碍物（如墙、门、冰箱、文件柜）的阻隔，覆盖单元和网络单元只能放得更近一些。建立好连接后，您可以通过移动任意一个单元来调整覆盖单元上显示的数字。",
        "NUTroubleShootingLine12":"间歇性出现距离过远问题。尽管系统上显示最多的信号格数，而您可能让它们距离过远了，这或许会导致因间歇性干扰而引起的连接中断。频繁或间歇性的出现上述问题可能是因为您住所或办公室的WiFi过强，或者因为两个单元间有障碍物移动。请确保每个单元都距离无限网络接入点或其他具有WiFi功能的设备足够远。无限网络设备包括但不限于无线家庭电话、笔记本电脑和无线路由器。",
        "NUTroubleShootingLine2":"如果您在交换电源装置后发现电源问题从一个单元转移到另外一个单元，那么您的电源装置可能有故障。请及时到您的购买网点更换电源装置。",
        "NUTroubleShootingLine3":"如果在交换电源装置后网络单元仍没有通电，请尝试换个电源插座或者接在其他能正常工作的灯具或电器的插座上。如果问题依旧没有解决，请及时到您的购买网点进行更换。",
        "NUTroubleShootingLine4":"如果在交换电源装置后两个系统都可以正常工作，那么您只需要重启一下Cel-Fi PRO系统。该问题应该不会再出现，但如果继续频繁发生，请及时到您的购买网点咨询。",
        "NUTroubleShootingLine5":"网络单元上显示信号格为空，表明其正在搜索蜂窝网络信号。网络单元上可能显示“搜索网络中..”的信息，这个过程需要几分钟时间。如果超过60分钟，请尝试：",
        "NUTroubleShootingLine6":"在您的住所或办公室里持移动通信设备找到能接收到至少一格稳定3G、4G或LTE信号的位置，格数越多越好。将网络单元放到此处。",
        "NUTroubleShootingLine7":"如果您的手机在网络单元处有信号，但60分钟后网络单元上显示信号格仍为空，您可以重启一下网络单元。您只需将覆盖单元断电几秒后重新接入电源。如果重启后故障仍然存在，请及时联系您的购买网点以获得更多帮助。",
        "NUTroubleShootingLine7a":"网络单元（NU）会持续搜索覆盖单元（CU）",
        "NUTroubleShootingLine8":"Cel-Fi PRO已经搜索到网络信号，网络单元（NU）上也显示了信号格。但网络单元仍在搜索覆盖单元（CU），并尝试与其建立连接。",
        "NUTroubleShootingLine9":"如果该显示超过了30分钟，那么您的Cel-Fi PRO系统可能遇到以下问题。",
        "Of":"of",
        "Off":"离",
