        "ProErrorCodeHWErrorSub7":"网络单元距离信号塔过近，这可能导致网络单元为减小网络干扰而降低输出功率（覆盖范围变小）。",
        "ProErrorCodeHWErrorSub8":"如果信号增强的效果满足您的使用需求，您可以忽略这条报错信息。否则请将网络单元移动到其他位置，您可将其置于家中/办公室内的另一侧。",
        "ProErrorCodeHWErrorSub9":"注意：一些情况下报错 9无法通过重新注册来修复，您只能将系统放回原注册地址。",
        "ProErrorCodeNoSignalSub1":"信号过弱，无法增强。请尝试：在您的住所或办公室里持移动通信设备找到能接收到至少一格稳定3G、4G或LTE信号的位置，格数越多越好。将网络单元放到此处。",
        "ProErrorNuHWError":"“（报错 6）网络单元硬件故障”网络单元可能出现硬件故障，可通过重启来解决。请尝试：重启网络单元。您只需将覆盖单元断电几秒后重新接入电源。如果重启后错误仍然存在，请及时联系您的购买网点以获得更多帮助。如果您最近更新过软件，请再重试一次。如果重试后故障仍然存在，请及时联系您的购买网点以获得更多帮助。",
        "ProErrorNUIpSigTooStrong":"“（报错 8）输入信号过强”网络单元距离信号塔过近，这可能导致网络单元为减小网络干扰而降低输出功率（覆盖范围变小）。请尝试：将网络单元移动到其他位置，您可将其置于家中的另一侧。",
        "ProErrorNuLocationAccess":"“（报错 9）位置锁定-需要注册”系统移到原注册地址之外。请将系统移回原注册地址，或通过无线运营商重新注册您的地址。系统可通过WAVE应用进行注册。注意：一些情况下报错 9无法通过重新注册来修复，您只能将系统放回原位。如果重新注册没有解决报错 9，请联系您的购买网点。",
        "ProErrorNuNotReceivingSig":"“（报错 1）无法接收信号”信号过弱，无法增强。请尝试：在您的住所或办公室里持移动通信设备找到能接收到至少一格稳定3G、4G或LTE信号的位置，格数越多越好。将网络单元放到此处。注意：如果安装了外接天线，请先检查天线连接。",
        "ProErrorNuOverHeating":"网络单元过热。请确保网络单元的通风口没有堵塞，并将其置于通风处。如果您将网络单元置于过热的区域，请及时将其放到阴凉处避免持续过热。网络单元将在冷却后继续正常工作，正常工作的温度范围为摄氏0到40度。",
        "ProErrorNuRegRequired":"“（报错 5）需要注册”使用前您需要注册本设备并获得您的运营商的许可。您需要使用制造商指定的线缆来操作本设备。可通过WAVE应用进行注册。",
        "ProErrorNuTooClose":"距离过近  覆盖单元距离网络单元过近。请尝试先移动覆盖单元，将两个单元距离更远一些。",
        "ProErrorNuTooFar":"距离过远  覆盖单元距离网络单元过远。请尝试先移动覆盖单元，将两个单元距离稍微近一些（1.5到3米）。间歇性“距离过远”信息？频繁或间歇性的出现上述问题可能是因为您住所或办公室的WiFi过强。请确保每个单元都距离无限网络接入点或其他具有WiFi功能的设备足够远。",
        "ProErrorNUUnitDisabled":"“（报错 7）系统被网络运营商禁用”系统被移动网络运营商禁用。请联系您的购买网点以获得更多帮助。",
        "ProtectionOfCompanyOthers":"对公司和他人的保护",
        "ProtectionOfCompanyOthersSub1":"我们保留如下权利：为服从法律或法院指令、执行我们的协议或保护公司、雇员、用户及其他人的权利、财产及安全，我们有权查询、阅读、保存和披露任何我们认为所必需信息。",
        "ProtectionOfCompanyOthersSub2":"无论何时，只要您认为Nextivity没有遵守本隐私政策，或对本政策以及收集、使用您的个人信息方法的有疑问，请与我们联系。您可以通过发送电子邮件至info@nextivityinc.com与Nextivity联系，邮件主题请包含“隐私”字样。 ",
        "ProtectionOfCompanyOthersSub3":"您的浏览器可能会提供“让网站不要跟踪我”的选项，该选项会向网络运营商、Web应用程序和服务（包括行为广告服务）运营商发送请求，表明您不希望运营商在一段时间内跟踪您的线上活动。我们的服务不支持“让网站不要跟踪我”的请求，这意味着我们在您使用服务时和离开服务后，均会收集有关您的线上活动信息。 ",
        "ProTroubleShootingText1":"以下原因可能导致您的系统未通电或者电源指示灯为红色。您可能遇到电源适配器或硬件故障，也可能只需要重启一下系统。",
        "ProTroubleShootingText2":"请尝试：覆盖单元和网络单元有相同的电源装置，请尝试交换一下电源装置看下面的情况是否会发生。",
        "ProTroubleShootingText2sub1":"如果您在交换电源装置后发现电源问题从一个单元转移到另外一个单元，那么您的电源装置可能有故障。请及时到您的购买网点更换电源装置。",
        "ProTroubleShootingText2sub2":"如果在交换电源装置后覆盖单元仍没有通电，请尝试换个电源插座或者接在其他能正常工作的灯具或电器的插座上。如果问题依旧没有解决，请及时到您的购买网点进行更换。",
        "ProTroubleShootingText2sub3":"如果在交换电源装置后两个系统都可以正常工作，那么您只需要重启一下系统。该问题应该不会再出现，但如果继续频繁发生，请及时到您的购买网点咨询。",
        "ProTroubleShootingText3":"当覆盖单元没有显示信号格但网络单元有显示，表明系统仍在启动中。启动时间如果超过45分钟，请将两个单元重启。",
        "ProTroubleShootingText4":"当Cel-Fi PRO系统的覆盖单元上显示1-2格信号时，表明已经建立连接但没有运行到最佳状态。请尝试：将覆盖单元和网络单元距离更远一些。如果在您的家中有特别需要增强信号的区域，请尝试颠倒网络单元与覆盖单元的安装顺序。先将覆盖单元置于您最想增强信号的位置，然后将网络单元放到尽量远但至少能接收到1格信号的位置。",
        "ProTroubleShootingText5":"如果您无法将两个单元距离更远，而且您的增强信号目的已达到，毋须一味追求更高的覆盖单元数值。",
        "ProTroubleShootingText6":"改变Cel-Fi放位置能够改善3G/4G/LTE信号覆盖范围。",
        "ProTroubleShootingText7":"网络单元显示的信号格数越多越好。请尝试将网络单元移动到3G、4G或LTE信号更强的区域。如果您的住所或办公室高于一层，通常楼上的信号比楼下的强。将网络单元置于临窗或柜子顶端通常效果更佳。",
        "ProTroubleShootingText8":"覆盖单元上显示的数值表示覆盖区域的大小，数值越高表示覆盖的区域越大。为了扩大覆盖区域，请将覆盖单元移动到离网络单元尽可能远的地方。两个单元间的障碍物越少，距离就可以越远。覆盖单元上显示的数值越高，信号覆盖情况就越好。",
        "ProTroubleShootingText9":"以下几个原因可能导致您的手机无法使用LTE服务：您不在LTE的服务区；您的Cel-Fi系统由于间歇性的网络故障没有接收到LTE信号；您的手机不支持LTE。请查看您的手机在网络单元处是否会显示LTE标志。",
