        "TermsPolicy":"条款/政策",
        "TermsPolicyContent1":"在Nextivity公司，我们坚持以行业标准来保证您的隐私安全。本隐私政策适用于所有Nextivity网站及相关服务（包括但不限于Nextivity移动应用）（统称“服务”）上的数据收集和使用。Nextivity的网站是大众网站。我们会以本政策声明中所描述的方式，收集、使用和披露所有服务使用者的个人信息。本政策声明不包括我们不拥有或控制的公司，以及不受我们管理的人对个人信息的处理、收集、使用或披露。 ",
        "TermsPolicyLine1":"在Nextivity公司，我们坚持以行业标准来保证您的隐私安全。本隐私政策适用于所有Nextivity网站及相关服务（包括但不限于Nextivity移动应用）（统称“服务”）上的数据收集和使用。Nextivity的网站是大众网站。",
        "TermsPolicyLine10":"我们会雇佣其他公司和个人代表我们为您提供产品和服务，因此需要将您的个人信息与其共享。除非我们对您另行告知，我们的代理只能使用这些信息为您提供产品和服务。",
        "TermsPolicyLine11":"我们可能选择购买或出售资产，而用户信息作为此类交易评估和发起的一部分，可能被共享和转让。此外，如果我们（或者我们的资产）遇到收购、倒闭、破产或控制权变更等情况，用户信息有可能作为资产的一部分转让给第三方。",
        "TermsPolicyLine12":"对公司和他人的保护",
        "TermsPolicyLine13":"我们保留如下权利：为服从法律或法院指令、执行我们的协议或保护公司、雇员、用户及其他人的权利、财产及安全，我们有权查询、阅读、保存和披露任何我们认为所必需信息。",
        "TermsPolicyLine14":"管理个人信息",
        "TermsPolicyLine15":"您可以通过发送电子邮件至info@nextivityinc.com联系Nextivity，我们会帮助您删除、查看和修改您之前向我们提供的部分或所有个人信息。",
        "TermsPolicyLine16":"关于隐私政策的附加信息 ",
        "TermsPolicyLine17":"无论何时，只要您认为Nextivity没有遵守本隐私政策，或对本政策以及收集、使用您的个人信息方法的有疑问，请与我们联系。您可以通过发送电子邮件至info@nextivityinc.com与Nextivity联系，邮件主题请包含“隐私”字样。 ",
        "TermsPolicyLine18":"本政策不适用于运营商、其他在线/离线合作伙伴或附属网站以及链接在我们公司网站上的其他产品和服务。Nextivity不负责执行这些网站的隐私政策。此外，Nextivity不对这些网站上的内容负责，内容包括但不限于特惠信息、文本、复制品、照片、图片、广告宣传以及名称等。",
        "TermsPolicyLine19":"根据加利福尼亚民法第1798.83-1798.84条，加利福尼亚居民有权要求我们向其发送通知，说明我们与附属机构和用于营销的第三方所共享的个人信息类别，以及向这些分支机构和第三方提供的联系信息。如果您是加利福尼亚居民，并且想要一份通知的复印件，请提交书面请求至：info@nextivityinc.com。",
        "TermsPolicyLine2":"我们会以本政策声明中所描述的方式，收集、使用和披露所有服务使用者的个人信息。本政策声明不包括我们不拥有或控制的公司，以及不受我们管理的人对个人信息的处理、收集、使用或披露。 ",
        "TermsPolicyLine20":"您的浏览器可能会提供“让网站不要跟踪我”的选项，该选项会向网络运营商、Web应用程序和服务（包括行为广告服务）运营商发送请求，表明您不希望运营商在一段时间内跟踪您的线上活动。我们的服务不支持“让网站不要跟踪我”的请求，这意味着我们在您使用服务时和离开服务后，均会收集有关您的线上活动信息。 ",
        "TermsPolicyLine3":"除非您自愿向我们提供个人信息，否则我们不会主动收集。我们可能会出于以下一些原因收集您的个人信息：为Nextivity的产品进行注册/向在线调查问卷提供反馈/请求产品的信息/联系Nextivity客服代表。Nextivity只会将您的个人信息用于提供服务和配送产品等情况，下文将会详细介绍。仅在下文提及的情况下，我们可能会将您的部分个人信息与第三方共享。",
        "TermsPolicyLine4":"请注意，Nextivity可能就Nextivity产品的拥有情况或公司官网的使用情况（如访问和下载新产品软件）联系您。如果不希望我们联系您，请发送电子邮件至：support@cel-fi.com。",
        "TermsPolicyLine5":"收集的个人信息可能包括您的姓名、电话号码、传真号、家庭住址、通讯地址和邮箱地址。您也可能需要提供关于自己的其他信息，如工作性质、行业类型、公司名称、职称以及公司规模。",
