        "Welcome":"欢迎",
        "WhatCelFiDifferentFromOtherSignal":"与其他信号增强器相比，Cel-Fi与众不同？",
        "WhatCelFiDifferentFromOtherSignalAnswer":"Cel-Fi是智能信号增强器，采用的智能、自组织算法让您在享受大范围信号覆盖的同时，不会对手机运营商网络产生任何影响，也不会干扰其他用户的使用。使用Cel-Fi系统不需要在现有的网络基础或手机设备上添加任何装置，也无需对其进行任何配置和改变。Cel-Fi是真正的即插即用系统，无需专业的安装，也无需钻孔与线缆。此外，Cel-Fi精良的设计和优秀的性能已被广泛认可。Cel-Fi是唯一被澳大利亚和英国通信委员会认可的智能信号增强器，也是唯一满足新FCC安全港二代协议规范的智能信号增强器（该协议允许很高的信号增益，让低水平信号也能覆盖大范围区域）。",
